CREATE DEFINER=`root`@`%` FUNCTION `avalue_nrfreq`(the_attribute varchar(32),
                              the_value     VARCHAR(254),
                              the_npersons  INTEGER(7)) RETURNS float(7,6)
BEGIN

    DECLARE the_count INTEGER(6);
    DECLARE the_npersons INTEGER(6);

    IF the_npersons = 0 OR the_npersons IS NULL
    THEN
      SET the_npersons = get_attribute_npersons(the_attribute);
    END IF;
    SELECT count(distinct person)
    INTO the_count /* persons with this value */
    FROM attributes
    WHERE attribute = the_attribute
          AND value = the_value;
    RETURN the_count / the_npersons;
  END ;;
