CREATE DEFINER=`root`@`%` FUNCTION `avalue_prandom`(the_attribute VARCHAR(32),
                               value         VARCHAR(254),
                               the_npersons  INTEGER(6)) RETURNS float(7,6)
    READS SQL DATA
    DETERMINISTIC
BEGIN

    DECLARE the_count INTEGER(6);

    IF the_npersons = 0 OR the_npersons IS NULL
    THEN
      SET the_npersons = get_attribute_npersons(the_attribute);
    END IF;
    SELECT count(distinct entity)
    INTO the_count /* persons with this value */
    FROM attributes
    WHERE the_type = the_attribute
          AND the_value = value;

    IF the_count = 1
    THEN
      RETURN 0;
    ELSE
      RETURN power(the_count / the_npersons, 2);
    END IF;

  END ;;
