CREATE DEFINER=`root`@`%` FUNCTION `bw`(the_rfreq     FLOAT(7, 6),
                   the_pnotlink  FLOAT(7, 6),
                   the_apnotlink FLOAT(7, 6),
                   the_pnlcases  INTEGER(6),
                   the_cv        FLOAT) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE the_bw FLOAT;
    DECLARE temp FLOAT;
    DECLARE the_vpnotlink FLOAT;
    DECLARE the_vapnotlink FLOAT;

    IF the_apnotlink IS NULL
    THEN -- se nao ha informacao estimamos em 5%
      SET the_vapnotlink = 0.05;
    ELSE
      SET the_vapnotlink = the_apnotlink;
    END IF;

    /* IF the number of real persons with this attribute is less than 10 then
      use the attribute's pnotlink.
    */

    IF the_pnlcases < 10 OR the_pnlcases IS NULL
    THEN
      SET the_vpnotlink = the_vapnotlink;
    --	CALL print_nl('apnotlink used.');
    ELSE
      SET the_vpnotlink = the_pnotlink;
    -- CALL print_nl('pnotlink used.');
    END IF;

    IF the_vpnotlink = 1
    THEN
      SET the_vpnotlink = 0.99; -- Why?
    END IF;
    IF the_vpnotlink = 0
    THEN
      SET the_vpnotlink = 0.01; -- Why?
    END IF;

    -- CALL print_nl(concat('pnotlink final: ',the_vpnotlink));

    IF the_cv < 0
    THEN
      SET temp = (the_rfreq - ((1 - the_vpnotlink) * the_rfreq)) / (the_rfreq - the_rfreq * the_rfreq);
      -- CALL print_nl(concat('temp=',temp));
      SET the_bw = log(2, temp);
    ELSE
      SET the_bw = log(2, ((1 - the_vpnotlink) * the_rfreq) / (the_rfreq * the_rfreq));
    END IF;

    RETURN the_bw;
  END ;;
DELIMITER ;
