CREATE DEFINER=`root`@`%` FUNCTION `can_enter_clust`(vgraph VARCHAR(64),
                                node   VARCHAR(64),
                                vclust SMALLINT) RETURNS float(7,4)
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE nnodes INTEGER;
    DECLARE nedges INTEGER;
    DECLARE vavg FLOAT(7, 4);

    SELECT count(*)
    INTO nnodes
    FROM candidates
    WHERE clust = vclust AND graph = vgraph;
    SELECT
      count(*),
      avg(bweight)
    INTO nedges, vavg
    FROM ledges e, candidates c
    WHERE e.instanceA = node AND e.instanceB = c.instance AND c.graph = vgraph
          AND c.clust = vclust
          AND e.graph = vgraph AND e.status IN ('G', 'L');

    IF nedges < nnodes
    THEN
      RETURN -vavg;
    ELSE
      RETURN vavg;
    END IF;
  END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
