CREATE DEFINER=`root`@`%` FUNCTION `can_join_clust`(vgraph  VARCHAR(64),
                               vclustA SMALLINT,
                               vclustB SMALLINT) RETURNS float(7,4)
    READS SQL DATA
    DETERMINISTIC
BEGIN

    DECLARE nnodesA INTEGER;
    DECLARE nnodesB INTEGER;
    DECLARE nedges INTEGER;
    DECLARE vavg FLOAT(7, 4);

    SELECT count(*)
    INTO nnodesA
    FROM candidates
    WHERE clust = vclustA AND graph = vgraph;
    SELECT count(*)
    INTO nnodesB
    FROM candidates
    WHERE clust = vclustB AND graph = vgraph;
    SELECT
      count(*),
      avg(bweight)
    INTO nedges, vavg
    FROM ledges e, candidates A, candidates B
    WHERE A.clust = vclustA AND B.clust = vclustB
          AND A.graph = vgraph
          AND B.graph = vgraph
          AND A.instance = e.instanceA AND B.instance = e.instanceB
          AND e.graph = vgraph AND e.status IN ('G', 'L');

    /*
              CALL llog(vgraph,vclustA,VclustB,concat(
           'CAN_JOIN_CLUSTERS: nodesA=',TO_CHAR(nnodesA),
                  ' nodesB=',nnodesB,
                   'nedges=',nedges));
  */

    IF nedges < nnodesA * nnodesB
    THEN
      RETURN -vavg;
    ELSE
      RETURN vavg;
    END IF;
  END ;;
DELIMITER ;
