CREATE DEFINER=`root`@`%` FUNCTION `cmp_attribute`(attrib VARCHAR(32),
                              valueA VARCHAR(254),
                              valueB VARCHAR(254),
                              idA    VARCHAR(64),
                              idB    VARCHAR(64)) RETURNS float
BEGIN
    DECLARE no_compare_values, no_compare_attributes VARCHAR(2048);

    SET no_compare_values = get_par('rl.values.ignored.for.match');
    SET no_compare_attributes = get_par('rl.attributes.ignored.for.match');
    IF FIND_IN_SET(valueA, no_compare_values) > 0 OR FIND_IN_SET(valueA, no_compare_values) > 0
    THEN
      RETURN 0;
    ELSEIF
      FIND_IN_SET(attrib, no_compare_attributes) > 0
      THEN -- atributos que nunca se comparam
        RETURN 0;
    ELSEIF valueA = valueB
      THEN -- TODO use specialized compare functions
        RETURN 1;
    ELSE
      RETURN -1;
    END IF;
  END ;;
DELIMITER ;
