CREATE DEFINER=`root`@`%` FUNCTION `count_interrog`(vnvalue VARCHAR(254)) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

    DECLARE nint INTEGER;
    DECLARE i INTEGER;

    IF vnvalue IS NULL
    THEN RETURN NULL;
    END IF;

    IF INSTR(vnvalue, '?') = 0
    THEN RETURN 0;
    END IF;

    SET nint = 0;
    SET i = 1;

    chars: LOOP
      IF i > LENGTH(vnvalue)
      THEN LEAVE chars; END IF;
      IF SUBSTR(vnvalue, i, 1) = '?'
      THEN
        SET nint = nint + 1;
      END IF;
      SET i = i + 1;
    END LOOP;
    RETURN nint;

  END ;;
DELIMITER ;
