CREATE DEFINER=`root`@`%` FUNCTION `edge_type`(clustA SMALLINT, clustB SMALLINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

    DECLARE clustT SMALLINT;

    SET clustT := clustA + clustB;
    IF clustT = 0
    THEN RETURN 1; /* NOT connected */

    ELSEIF clustT = clustA
      THEN RETURN 2; /* left conn */

    ELSEIF clustT = clustB
      THEN RETURN 3; /* right conn */

    ELSEIF clustA = clustB
      THEN RETURN 0; /* both IN same */

    ELSE RETURN 4; /* connected to two diferent ones */

    END IF;
  END ;;
DELIMITER ;
