CREATE DEFINER=`root`@`%` FUNCTION `eval_graph`(G VARCHAR(64)) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN
		DECLARE tot_G INTEGER; -- altas mantidas
		DECLARE tot_L INTEGER; -- baixas mantidas
		DECLARE tot_B INTEGER; -- altas eliminadas
		DECLARE tot_C INTEGER; -- baixas eliminadas
		DECLARE tot_T INTEGER; -- eliminadas de todo (GTEST)

		select sum(bweight) into tot_G from ledges where graph=G and
		   instanceA < instanceB and status='G';

		select sum(bweight) into tot_L from ledges where graph=G and
		   instanceA < instanceB and status='L';

		select sum(bweight) into tot_B from ledges where graph=G and
		   instanceA < instanceB and status='B';

		select sum(bweight) into tot_C from ledges where graph=G and
		   instanceA < instanceB and status='C';

		select sum(bweight) into tot_T from ledges where graph=G and
		   instanceA < instanceB and status='T';

		IF tot_G is NULL then SET tot_G := 0; end if;
		IF tot_L is NULL then SET tot_L := 0; end if;
		IF tot_B is NULL then SET tot_B := 0; end if;
		IF tot_C is NULL then SET tot_C := 0; end if;
		IF tot_T is NULL then SET tot_T := 0; end if;

	-- return log((tot_G+tot_L) /(tot_B+tot_C+tot_T),2);
		return (tot_G+tot_C) / (tot_B+tot_L+1);
	end ;;
DELIMITER ;
