CREATE DEFINER=`root`@`%` FUNCTION `normalize_place`(vplace VARCHAR(254), lang VARCHAR(12)) RETURNS varchar(254) CHARSET utf8mb3
    READS SQL DATA
    DETERMINISTIC
BEGIN

    DECLARE nplace VARCHAR(254);
    DECLARE particle VARCHAR(32);
    DECLARE remains VARCHAR(254);

    SET remains = strip_commas(vplace);
    SET nplace = '';
    words: LOOP
      IF remains = '' OR remains IS NULL
      THEN
        LEAVE words;
      END IF;
      CALL break_name(remains, particle, remains);

      IF NOT pligp(lang, particle)
      THEN
        IF nplace > ' '
        THEN SET nplace = concat(nplace, ' ', particle);
        ELSE SET nplace = particle;
        END IF;
      END IF;


    END LOOP;
    return nplace;
  END ;;
DELIMITER ;
