    READS SQL DATA
    DETERMINISTIC
BEGIN
 IF lang='PT' THEN
    IF part = 'da' OR part = 'de'  OR part = 'do'  OR part = 'das'
       OR part = 'dos'  OR part = 'a'  OR part = 'e'  OR part = 'o' THEN
