CREATE DEFINER=`root`@`%` FUNCTION `show_person`(the_id VARCHAR(64),
                            pars   VARCHAR(12)) RETURNS text CHARSET utf8mb3
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE output TEXT;
    DECLARE my_indent VARCHAR(128);
    DECLARE old_indent VARCHAR(128);
    DECLARE indent_one VARCHAR(12) DEFAULT ' ';
    DECLARE the_name VARCHAR(128);
    DECLARE the_sex VARCHAR(1);
    DECLARE the_obs, v_obs VARCHAR(1024);
    DECLARE v_attribute, p_attribute VARCHAR(32);
    DECLARE v_value, p_value VARCHAR(254);
    DECLARE v_reltype, p_reltype VARCHAR(32);
    DECLARE v_relvalue, p_relvalue VARCHAR(254);
    DECLARE v_date, p_date VARCHAR(24);
    DECLARE v_reldate VARCHAR(24);
    DECLARE date_count INTEGER;
    DECLARE the_rid VARCHAR(64);
    DECLARE end_of_loop SMALLINT;
    DECLARE attribs CURSOR FOR
      SELECT
        the_type,
        the_value,
        the_date,
        obs
      FROM attributes
      WHERE entity = the_id AND
            (obs IS NULL OR obs NOT LIKE '*%')
      ORDER BY the_type, the_value, the_date;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_loop = 1;

    SET my_indent := '   ';

    SELECT
      name,
      sex,
      obs
    INTO the_name, the_sex, the_obs
    FROM persons
    WHERE id = the_id;

    SET the_rid := rid(the_id);

    SET output := concat('pessoa$'
    , the_name
    , '/'
    , the_sex
    , '/id=', the_id);
    IF the_rid <> the_id
    THEN
      SET output := concat(output
      , '/rperson=', the_rid, '\n'
      , my_indent, indent_one
      , '/obs=', 'Pessoa identificada.');
    END IF;
    IF the_obs <> ''
    THEN
      SET output := concat(output, '\n'
      , my_indent, indent_one
      , '/obs=', the_obs);
    END IF;

    SET my_indent := concat(my_indent, indent_one);
    SET p_attribute := 'Z';
    SET p_value := 'Z';
    SET p_date := 0;

    SET end_of_loop := 0;
    OPEN attribs;
    FETCH attribs
    INTO v_attribute, v_value, v_date, v_obs;
    WHILE (end_of_loop = 0) DO
      IF v_attribute <> p_attribute OR v_value <> p_value
      THEN
        SET output := concat(output, '\n');
        SET output := concat(output, my_indent
        , 'atr$'
        , v_attribute
        , '/', v_value);
        SET output := concat(output, '\n'
        , my_indent
        , indent_one
        , break_date(v_date));
        SET date_count := 1;
      ELSE /* ja temos. acrescentar data */
        SET date_count := date_count + 1;
        IF date_count < 3
        THEN
          SET output := concat(output, '/'
          , break_date(v_date));
        ELSE
          SET output := concat(output, '\n'
          , my_indent
          , indent_one
          , break_date(v_date));
          SET date_count := 1;
        END IF;
      END IF;

      IF v_obs <> ' '
      THEN
        SET output := concat(output, '/obs='
        , v_obs);
      END IF;

      SET p_attribute := v_attribute;
      SET p_value := v_value;
      FETCH attribs
      INTO v_attribute, v_value, v_date, v_obs;

    END WHILE;
    CLOSE attribs;
    /*
     the_reltype := 'Z';
     the_relvalue := 'Z';

     for rel in (select rid(origin) origin,rid(destination) destination,rdate,type,value,source,obs from relations
                 where origin = the_id or destination=the_id order by type,value, rdate) loop

       IF rel.origin = the_rid THEN
         IF the_reltype <> rel.type or the_relvalue <> rel.value THEN
              output := output , '\n'  , my_indent
                      , 'rel$'
                      , rel.type
                      , '/'
                      , rel.value
                        , '\n'
                        , my_indent , indent_one
                        ,  '/'
                         , identify(rel.destination)
                               ,'/'
                               , rel.destination
                               , '/'
                               ,   break_date(rel.rdate) ;
              date_count := 1;
         ELSE
           date_count := date_count +1;
           IF date_count > 1 THEN
              output := output , '\n'
                        , my_indent
                        , indent_one
                        , '/'
                         ,identify(rel.destination)
                         ,'/'
                         , rel.destination
                         , '/'
                         ,   break_date(rel.rdate) ;
              date_count := 1;
           ELSE
              output := output
                        , '/'
                             ,identify(rel.destination)
                              ,'/'
                      , rel.destination
                      , '/'
                         ,   break_date(rel.rdate) ;
           END IF;
         END IF;
       the_reltype := rel.type;
      ELSE --  pessoa é destino da relacao
         IF the_reltype <> '>' , rel.type or the_relvalue <> rel.value THEN
              output := output , '\n' , my_indent
                      , '>rel$'
                      , rel.type
                      , '/'
                      , rel.value
                        , '\n'
                        ,  my_indent , indent_one
                        , '/'
                        ,identify(rel.origin)
                        ,'/'
                        , rel.origin , '/'
                         ,   break_date(rel.rdate) ;
              date_count := 1;
         ELSE
           date_count := date_count +1;
           IF date_count > 1 THEN
              output := output , '\n' , my_indent , indent_one
                        , '/'
                       ,identify(rel.origin)
                        ,'/'
                        , rel.origin
                        , '/'
                         ,   break_date(rel.rdate) ;
              date_count := 1;
           ELSE
              output := output   , '/'
                          ,identify(rel.origin)
                          ,'/'
                          , rel.origin
                          , '/'
                           ,   break_date(rel.rdate)  ;
           END IF;
         END IF;
         the_reltype := '>' , rel.type;
      END IF;

     IF rel.obs <> ' ' THEN
       output := output
             , '/'
             , rel.obs ;
     END IF;

     the_relvalue := rel.value;

    end LOOP;
   */

    SET output := concat(output, '\n');

    RETURN output;
  END ;;
