CREATE DEFINER=`root`@`%` FUNCTION `strip_commas`(vnvalue VARCHAR(254)) RETURNS varchar(254) CHARSET utf8mb3
BEGIN

    DECLARE temp VARCHAR(254);
    DECLARE i INTEGER(6);

    IF vnvalue IS NULL
    THEN RETURN NULL;
    END IF;
    IF INSTR(vnvalue, ',') = 0
    THEN
      RETURN vnvalue;
    END IF;

    SET temp = '';
    SET i = 1;

    chars: LOOP
      IF i > LENGTH(vnvalue)
      THEN
        LEAVE chars;
      END IF;
      IF SUBSTR(vnvalue, i, 1) <> ','
      THEN
        SET temp = concat(temp, SUBSTR(vnvalue, i, 1));
      ELSE
        -- TODO should check if the next char is a space if yes not replace the comma by a space
        SET temp = concat(temp, ' ');
      END IF;
      SET i = i + 1;
    END LOOP;
    RETURN temp;

  END ;;
DELIMITER ;
