CREATE DEFINER=`root`@`%` PROCEDURE `attribute_normalization_suggestions`(vattribute VARCHAR(32), threshold INTEGER)
BEGIN
    select
      n1.id,
      n1.attribute,
      n1.nvalue,
      n1.npersons,
      n2.nvalue,
      n2.npersons
    from nvalue_info n1, nvalue_info n2
    where n1.attribute = vattribute and n1.npersons <= threshold and
          n1.attribute = n2.attribute and
          n2.npersons > threshold and
          n2.nvalue sounds like n1.nvalue
    order by n1.attribute, n1.nvalue, n2.npersons desc;
  END ;;
DELIMITER ;
