CREATE DEFINER=`root`@`%` PROCEDURE `attribute_npnotlink`(
  IN  the_attribute VARCHAR(32),
  OUT the_npersons  INTEGER(7),
  OUT the_pnotlink  FLOAT(7, 6))
BEGIN
    DECLARE the_cases INTEGER(7);
    DECLARE the_diferences INTEGER(7);
    DECLARE the_rperson VARCHAR(64);
    DECLARE the_total INTEGER(7);
    DECLARE the_difs INTEGER(7);
    DECLARE loop_end INT DEFAULT 0;
    DECLARE rpersons_with_attribute CURSOR FOR
      SELECT DISTINCT rid
      FROM links, attributes, rpersons
      WHERE links.instance = attributes.entity AND
            attributes.the_type = the_attribute AND
            rpersons.id = links.rid AND
            (rpersons.status IS NULL OR rpersons.status = 'v');
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET loop_end = 1;

    CALL insert_log(4, 'attribute_npnotlink', concat('START: ', the_attribute));
    SET the_npersons = 0;
    SET the_cases = 0;
    SET the_diferences = 0;
    SET the_pnotlink = 0;

    OPEN rpersons_with_attribute;

    REPEAT
      FETCH rpersons_with_attribute
      INTO the_rperson;
      SELECT
        count(nvalue),
        count(DISTINCT nvalue)
      INTO the_total, the_difs
      FROM links, attributes, value_info
      WHERE links.rid = the_rperson AND
            links.instance = attributes.entity AND
            attributes.the_type = the_attribute AND
            attributes.the_value = value_info.value AND
            attributes.the_type = value_info.attribute;

      IF NOT loop_end AND the_total > 1
      THEN
        SET the_npersons = the_npersons + 1;
        SET the_cases = the_cases + the_total;
        SET the_diferences = the_diferences + the_difs;
        CALL insert_log(5, 'npotlink the_rperson   :', the_rperson);
        CALL insert_log(5, 'npotlink the_npersons     :', cast(the_npersons AS CHAR));
        CALL insert_log(5, 'npotlink the_cases     :', cast(the_cases AS CHAR));
        CALL insert_log(5, 'npotlink the_diferences:', cast(the_diferences AS CHAR));

      END IF;
    UNTIL loop_end END REPEAT;
    CLOSE rpersons_with_attribute;

    SET the_pnotlink = (the_diferences - the_npersons) / (the_cases - the_npersons);
    CALL insert_log(4, 'attribute_npnotlink', concat('STOP: npnotlink=', the_pnotlink));

  END ;;
DELIMITER ;
