CREATE DEFINER=`root`@`%` PROCEDURE `avalue_npnotlink`(
  IN  the_attribute VARCHAR(32),
  IN  the_nvalue    VARCHAR(254),
  OUT the_npersons  INTEGER(7),
  OUT the_pnotlink  FLOAT(7, 6))
BEGIN

    DECLARE the_cases INTEGER(7);
    DECLARE the_total INTEGER(7);
    DECLARE the_difs INTEGER(7);
    DECLARE the_rperson VARCHAR(64);
    DECLARE the_diferences INTEGER(7);
    DECLARE loop_end INT DEFAULT 0;
    DECLARE rpersons_with_nvalue CURSOR FOR
      SELECT DISTINCT rid
      FROM links, attributes, rpersons, value_info
      WHERE links.instance = attributes.entity AND
            attributes.the_type = the_attribute AND
            attributes.the_value = value_info.value AND
            value_info.nvalue = the_nvalue AND
            rpersons.id = links.rid AND
            (rpersons.status is NULL OR rpersons.status = 'v');
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET loop_end = 1;


    SET the_npersons = 0;
    SET the_cases = 0;
    SET the_diferences = 0;
    SET the_pnotlink = 0;
    OPEN rpersons_with_nvalue;

    /* por cada pessoal real com este valor vemos o espectro de valores normalizados
         para o atributo respectivo dentro de todas as ocorrencias da pessa real.
         Por outras palavras: quantos valores diferentes, depois de normalizados, se encontram
         nas pessoas ja identificadas que possuem determinado par atributo/valor?

         Isto � uma aproximacao ao calculo mais dispendioso que seria assim:

         Dentro das pessoas reais que tem este par atributo/valor qual a proporcao de links
         que existem em que a concordancia deste atributo falha. Ai o algoritmo passaria pela
         analise de todos as arestas do grafo de ligacao em que ambos os nos possuem o atributo
         em questao. A diferenca entre o numero total de arestas com o atributo e arestas em
         que o atributo coincide forneceria a probabilidade de o atributo variar em pessoas
         efectivamente ligadas.

         O SQL para isso e' o seguinte:

         pr := pessoa real que sabemos possuir o par atributo valor (ver codigo acima)

         SELECT count(distinct l1.instance || l2.instance)
           FROM atributes a1, atributes a2, links l1, links l2, value_info v1, value_info v2
           WHERE
             l1.robject=pr AND l2.robject=pr AND l1.instance < l2.instance --todas arestas
             AND a1.person = l1.instance AND a2.person=l2.instance AND a1.atribute=the_attribute
             AND a2.atribute=the_attribute -- que tem este atributo
                       -- aqui conta as arestas com o atributo
                       -- a partir daqui conta so as que tem valor equivalente
                       -- a diferenca entre os dois count
             AND a1.value=v1.value AND a2.value=v2.value AND v1.nvalue=v2.value
       */
    REPEAT
      FETCH rpersons_with_nvalue
      INTO the_rperson;
      SELECT
        count(nvalue),
        count(distinct nvalue)
      INTO the_total, the_difs

      FROM attributes, links, value_info

      WHERE attributes.the_type = the_attribute AND attributes.entity = links.instance AND links.rid = the_rperson AND
            attributes.the_value = value_info.value;

      IF NOT loop_end AND the_total > 1
      THEN
        SET the_npersons = the_npersons + 1;
        SET the_cases = the_cases + the_total;
        SET the_diferences = the_diferences + the_difs;
      END IF;

    UNTIL loop_end END REPEAT;
    CLOSE rpersons_with_nvalue;

    IF the_cases = the_npersons
    THEN
      SET the_pnotlink = 0;
    ELSE
      IF the_npersons = 0
      THEN
        SET the_pnotlink = 0;
      ELSE
        SET the_pnotlink = (the_diferences - the_npersons) / (the_cases - the_npersons);
      END IF;
    END IF;

  END ;;
DELIMITER ;
