CREATE DEFINER=`root`@`%` PROCEDURE `break_name`(IN name VARCHAR(64), OUT start VARCHAR(64), OUT remains VARCHAR(64))
BEGIN
       DECLARE ofst SMALLINT;
 
        SET name=LTRIM(name);
        SET ofst = INSTR(name,' ');
        IF ofst = 0 THEN 
            SET remains = '';
            SET start = name;
        ELSE
            SET remains = LTRIM(SUBSTR(name,ofst));
            SET start =  SUBSTR(name,1,ofst-1);
        END IF;

    END ;;
DELIMITER ;
