CREATE DEFINER=`root`@`%` PROCEDURE `calc_rpersons_scores`(n1 INTEGER, n2 INTEGER)
BEGIN
    DECLARE arid VARCHAR(64);
    DECLARE c INTEGER;
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE rps CURSOR FOR
        SELECT rid,
               count(*)
        FROM links
        GROUP BY rid
        HAVING count(*) BETWEEN n1 AND n2
        ORDER BY count(*) DESC;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    OPEN rps;
    FETCH rps
        INTO arid, c;
    WHILE (end_of_cursor = 0)
        DO
            CALL calc_rperson_scores(arid);
            FETCH rps
                INTO arid, c;
        END WHILE;
END ;;
DELIMITER ;
