CREATE DEFINER=`root`@`%` PROCEDURE `calc_rperson_scores`(arid VARCHAR(64))
BEGIN
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE aida VARCHAR(64);
    DECLARE aidb VARCHAR(64);
    DECLARE ascore FLOAT(6, 3);
    DECLARE tscore FLOAT(7, 3);
    DECLARE edges CURSOR FOR
        SELECT la.instance ida,
               lb.instance idb
        FROM links la,
             links lb
        WHERE la.rid = lb.rid
          AND la.instance < lb.instance
          AND la.rid = arid;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    IF exists_table('rp_scores') = 0
    THEN
        CALL create_rp_scores_table();
    ELSE
        DELETE
        FROM rp_scores
        WHERE rid = arid;
        COMMIT;
    END IF;
    -- CLEAN STRAY INSTANCES
    DELETE
    FROM links
    WHERE rid = arid
      AND instance NOT IN (SELECT id
                           FROM entities);

    COMMIT;
    OPEN edges;
    FETCH edges
        INTO aida, aidb;
    WHILE (end_of_cursor = 0)
        DO
            CALL cmp_person(aida, aidb, ascore);
            FETCH edges
                INTO aida, aidb;
        END WHILE;
    COMMIT;
    SELECT max(rid)   AS rid,
           min(score) AS min,
           max(score) AS max,
           avg(score) AS average
    FROM rp_scores
    WHERE rid = arid;
END ;;
DELIMITER ;
