CREATE DEFINER=`root`@`%` PROCEDURE `check_acts_table`()
BEGIN
    CALL insert_log(1, 'check_acts_table', 'checking...');

    IF exists_table('acts') = 0
    THEN
      /* table acts */
      CREATE TABLE acts (
        id       varchar(64) primary key,
        the_type varchar(32),
        the_date varchar(24),
        loc      varchar(64),
        ref      varchar(64),
        obs      varchar(16000)
      );


      CREATE INDEX acts_date
        ON acts (the_date);

      values ('act', 'id', 'id', 'id', 'varchar', 64, 0, 1);
      values ('act', 'loc', 'loc', 'loc', 'varchar', 64, 0, 0);
      values ('act', 'ref', 'ref', 'ref', 'varchar', 64, 0, 0);
      values ('act', 'date', 'the_date', 'date', 'varchar', 24, 0, 0);
      values ('act', 'type', 'the_type', 'type', 'varchar', 32, 0, 0);
      values ('act', 'obs', 'obs', 'obs', 'varchar', 16000, 0, 0);
      CALL insert_log(1, 'check_acts_table', 'table created');
    END IF;
    IF column_size('acts', 'obs') < 16000
    THEN
        ALTER TABLE acts
            MODIFY column obs varchar(16000);
        CALL insert_log(0, 'check_acts_table', 'column obs size set to 16000');
    end if;

    CALL insert_log(1, 'check_acts_table', 'checked');
