BEGIN
    CALL insert_log(1, 'check_attributes_table', 'checking...');
    IF exists_table('attributes') = 0
    THEN
      CREATE TABLE attributes (
        id        varchar(64) primary key,
        entity    varchar(64),
        the_type  varchar(512),
        the_value varchar(1024),
        the_date  varchar(24),
        obs       varchar(16000)
      )
        ENGINE INNODB;

      CREATE INDEX attributes_entity
        ON attributes (entity);
      CREATE INDEX attributes_value
        ON attributes (the_value(100));
      CREATE INDEX attributes_type
        ON attributes (the_type(100));
      CREATE INDEX attributes_date
        ON attributes (the_date);

      values ('attribute', 'id', 'id', 'id', 'varchar', 64, 0, 1);
      values ('attribute', 'entity', 'entity', 'entity', 'varchar', 64, 0, 0);
      values ('attribute', 'date', 'the_date', 'date', 'varchar', 24, 0, 0);
      values ('attribute', 'type', 'the_type', 'type', 'varchar', 512, 0, 0);
      values ('attribute', 'value', 'the_value', 'value', 'varchar', 1024, 0, 0);
      values ('attribute', 'obs', 'obs', 'obs', 'varchar', 16000, 0, 0);
      CALL insert_log(0, 'check_attributes_table', 'attributes table created.');
    END IF;
    IF column_size('attributes', 'obs') < 16000
    THEN
        ALTER TABLE attributes
            MODIFY column obs varchar(16000);
        CALL insert_log(0, 'check_attributes_table', 'column obs size set to 16000');
    end if;
    IF column_size('attributes', 'the_type') < 512
    THEN
        ALTER TABLE attributes
            MODIFY column the_type varchar(512);
        CALL insert_log(0, 'check_attributes_table', 'column the_type size set to 512');
    end if;
    IF column_size('attributes', 'the_value') < 1024
    THEN
        ALTER TABLE attributes
            MODIFY column the_value varchar(1024);
        CALL insert_log(0, 'check_attributes_table', 'column the_value size set to 1024');
    end if;
    CALL insert_log(1, 'check_attributes_table', 'checked');
  END ;;
