CREATE DEFINER=`root`@`%` PROCEDURE `check_classes_table`()
BEGIN
    CALL insert_log(1, 'check_classes_table', 'checking...');
    /* check if we have the classes table */
    IF exists_table('classes') = 0
    THEN
      CREATE TABLE classes (
        id         VARCHAR(64) PRIMARY KEY,
        table_name VARCHAR(32),
        group_name VARCHAR(32),
        super      VARCHAR(64)
      )
        ENGINE INNODB;
      /* no indexes on classes because it is a really small table  */
      COMMIT;
      CALL insert_log(0, 'check_classes_table', 'classes table created.');
    END IF;

    IF exists_table('class_attributes') = 0
    THEN
      /* this table gets the element to attribute mappings */
      CREATE TABLE class_attributes (
        the_class    VARCHAR(64),
        name         VARCHAR(32),
        colname      VARCHAR(32),
        colclass     VARCHAR(32),
        coltype      VARCHAR(32),
        colsize      NUMERIC(5, 0),
        colprecision NUMERIC(6, 0),
        pkey         NUMERIC(1, 0)
      )
        ENGINE INNODB;

      CREATE INDEX class_attributes_pkey
        ON class_attributes (the_class, name);
      COMMIT;
      CALL insert_log(0, 'check_classes_table', 'classe_attributes table created.');
      VALUES ('entity', 'id', 'id', 'id', 'varchar', 64, 0, 1);
      VALUES ('entity', 'class', 'class', 'class', 'varchar', 64, 0, 0);
      VALUES ('entity', 'inside', 'inside', 'inside', 'varchar', 64, 0, 0);
      VALUES ('entity', 'order', 'the_order', 'order', 'numeric', 6, 0, 0);
      VALUES ('entity', 'level', 'the_level', 'level', 'numeric', 3, 0, 0);
      VALUES ('entity', 'line', 'the_line', 'line', 'numeric', 6, 0, 0);
      VALUES ('entity', 'groupname', 'groupname', 'groupname', 'varchar', 32, 0, 0);
      CALL insert_log(0, 'check_classes_table', 'classe_attributes initial values created.');
    END IF;

    /* fix precision of column colprecision in table class_attributes
        legacy databases */

    ALTER TABLE class_attributes
      CHANGE colprecision colprecision NUMERIC(6, 0);


    CALL insert_log(1, 'check_classes_table', 'checked');
  END ;;
