CREATE DEFINER=`root`@`%` PROCEDURE `check_family_structures`()
BEGIN
    DECLARE n SMALLINT;

    -- remove old family_structures if necessary
    CALL remove_old_family_structures();

    IF exists_table('rfamily') = 0
    THEN
      -- table RFamily
      -- TODO TABLE NAME should be plural rfamilies
      CREATE TABLE rfamily (
        id         VARCHAR(64) PRIMARY KEY,
        rid_pn     VARCHAR(64),
        rid_mn     VARCHAR(64),
        gen_id     VARCHAR(64),
        user       VARCHAR(64) DEFAULT NULL,
        date_proc  DATE,
        first_date VARCHAR(24),
        last_date  VARCHAR(24),
        first_act  VARCHAR(64),
        last_act   VARCHAR(64),
        obs        VARCHAR(16000)
      )
        ENGINE = INNODB;

      CREATE INDEX rfamily_id
        ON rfamily (id);
      CREATE INDEX rfamily_pn
        ON rfamily (rid_pn);
      CREATE INDEX rfamily_mn
        ON rfamily (rid_mn);
      CREATE INDEX rfamily_dateproc
        ON rfamily (date_proc);
      CREATE INDEX rfamily_user
        ON rfamily (user);
      CREATE INDEX rfamily_first_date
        ON rfamily (first_date);
      CREATE INDEX rfamily_last_date
        ON rfamily (last_date);
      CALL insert_log(2, 'check_family_structures', 'table rfamily created.');
    END IF;

    IF exists_table('rchildren') = 0
    THEN
      -- table RChildren
      CREATE TABLE rchildren (
        rfamily_id VARCHAR(64),
        rid        VARCHAR(64),
        date_proc  DATE        DEFAULT NULL,
        first_date VARCHAR(24),
        last_date  VARCHAR(24),
        first_act  VARCHAR(64),
        last_act   VARCHAR(64),
        user       VARCHAR(64) DEFAULT NULL,
        obs        VARCHAR(16000)
      )
        ENGINE = INNODB;

      CREATE INDEX rchildren_rfamilyid
        ON rchildren (rfamily_id);
      CREATE INDEX rchildren_rid
        ON rchildren (rid);
      CREATE INDEX rchildren_first_date
        ON rchildren (first_date);
      CREATE INDEX rchildren
        ON rchildren (last_date);
      CALL insert_log(2, 'check_family_structures', 'table rchildren created.');
    END IF;

    CALL check_family_views();
    CALL insert_log(1, 'check_family_structures', 'Family data structures checked.');
  END ;;
