CREATE DEFINER=`root`@`%` PROCEDURE `check_family_triplets`()
BEGIN

    IF exists_table('family_triplets') = 0
    THEN
        CREATE TABLE IF NOT EXISTS family_triplets AS
        SELECT fathers.origin AS father, mothers.origin AS mother, fathers.destination AS ego, fathers.the_date
        FROM relations fathers,
             relations mothers
        WHERE fathers.destination = mothers.destination
          AND fathers.the_type = 'parentesco'
          and fathers.the_value = 'pai'
          AND mothers.the_type = 'parentesco'
          and mothers.the_value = 'mae';

        CALL insert_log(2, 'check_family_triplets', 'table family_triplets created.');

        CREATE INDEX ft_father ON family_triplets (father);
        CREATE INDEX ft_mother ON family_triplets (mother);
        CREATE INDEX ft_ego ON family_triplets (ego);
    END IF;



END ;;
