CREATE DEFINER=`root`@`%` PROCEDURE `check_family_views`()
BEGIN
    DROP TABLE IF EXISTS family_rels;
    DROP TABLE IF EXISTS family_relations; -- old name removing if still around.
    DROP VIEW IF EXISTS family_rels;
    DROP VIEW IF EXISTS family_relations; -- old name removing if still around.

      -- family relations are generated by the translator. They register parenthood and couples.

    CREATE VIEW family_rels AS
      SELECT *
      FROM relations
      WHERE the_type LIKE '*family%';

    -- same with names and sex

    DROP TABLE IF EXISTS nfamily_rels;
    DROP VIEW IF EXISTS nfamily_rels;

    CREATE VIEW nfamily_rels AS
      SELECT
        fr.origin      AS ida,
        po.name        AS namea,
        po.sex         AS sexa,
        fr.destination AS idb,
        pd.name        AS nameb,
        pd.sex         AS sexb,
        fr.the_date    AS the_date,
        fr.the_type    AS the_type,
        fr.the_value   AS the_value
      FROM family_rels fr, persons po, persons pd
      WHERE fr.origin = po.id AND fr.destination = pd.id;

    -- these are the triplets: person, father, mother inferred from the family relations
    DROP TABLE IF EXISTS family_occurrences;
    DROP VIEW IF EXISTS family_occurrences;

    CREATE VIEW family_occurrences AS
      SELECT DISTINCT
        child.idb    n,
        child.nameb  name_n,
        father.ida   pn,
        father.namea name_pn,
        mother.ida   mn,
        mother.namea name_mn,
        father.the_date
      FROM nfamily_rels father, nfamily_rels mother, nfamily_rels child
      WHERE father.the_value = 'co-parent'
            AND father.sexa = 'm'
            AND mother.ida = father.idb
            AND mother.the_value = 'parent'
            AND mother.idb = child.idb;

    -- joining family occurrences with real persons
    -- this makes it easy to get all the families of origin and all the families created
    DROP TABLE IF EXISTS rfamily_occurrences;
    DROP VIEW IF EXISTS rfamily_occurrences;

    CREATE VIEW rfamily_occurrences AS
      SELECT
        ln.rid   rid_n,
        ln.user  user_n,
        n,
        name_n,
        lpn.rid  rid_pn,
        lpn.user user_pn,
        pn,
        name_pn,
        lmn.rid rid_mn,
        lmn.user user_mn,
        mn,
        name_mn,
        the_date
      FROM family_occurrences fo
        LEFT JOIN rlinks ln ON fo.n = ln.instance
        LEFT JOIN rlinks lpn ON (fo.pn = lpn.instance)
        LEFT JOIN rlinks lmn ON (fo.mn = lmn.instance);

   CALL insert_log(1, 'check_family_views', 'Family related views updated');
  END ;;
DELIMITER ;
