CREATE DEFINER=`root`@`%` PROCEDURE `check_index_structures`()
BEGIN
    if exists_table('entitiesIndex') = 1 AND exists_table('entitiesindex') = 0
    THEN
      CREATE TABLE temp_entitiesIndex SELECT *
                                      from entitiesIndex;
      DROP TABLE entitiesIndex;
      CREATE TABLE entitiesindex SELECT *
                                 FROM temp_entitiesIndex; -- problem this does not create the indexes
      DROP TABLE temp_entitiesIndex;
      CALL insert_log(2, 'check_system_structures', 'entitiesIndex table renamed to entitiesindex ');
    ELSE
      IF exists_table('entitiesIndex') = 1 AND exists_table('entitiesindex') = 1
      THEN
        CALL insert_log(-1, 'check_system_structures',
                        'ERROR: both entitiesIndex and entitiesindex table exist. Only entitiesindex should exist');
      END IF;
    END IF;

    if exists_table('entitiesindex') = 0
    then
      call create_entity_index_table();
    END IF;

    if exists_column('entitiesindex', 'first_date') = 0
    then
      alter table entitiesindex
        add column first_date varchar(8) NULL;
      call insert_log(0, 'check_index_structures', 'column "first_date" added to table entitiesindex');
      commit;
    end if;

    if exists_column('entitiesindex', 'last_date') = 0
    then
      alter table entitiesindex
        add column last_date varchar(8) NULL;
      call insert_log(0, 'check_index_structures', 'column "last_date" added to table entitiesindex');
      commit;
    end if;
    if exists_index('entitiesindex', 'description') = 0
    then
      create FULLTEXT INDEX description
        ON entitiesindex (description);
      call insert_log(0, 'check_index_structures', 'full text index "description" added to table entitiesindex');
    end if;
    if exists_index('entitiesindex', 'id') = 0
    then
      create INDEX id
        ON entitiesindex (id);
      call insert_log(0, 'check_index_structures', 'index "id" added to table entitiesindex');
    end if;
    if exists_index('entitiesindex', 'first_date') = 0
    then
      create INDEX first_date
        ON entitiesindex (first_date);
      call insert_log(0, 'check_index_structures', 'index "first_date" added to table entitiesindex');
    end if;

    if exists_index('entitiesindex', 'last_date') = 0
    then
      create INDEX last_date
        ON entitiesindex (last_date);
      call insert_log(0, 'check_index_structures', 'index "last_date" added to table entitiesindex');
    end if;

    if exists_column('entities', 'updated') = 0
    then
      alter table entities
        add column updated timestamp DEFAULT CURRENT_TIMESTAMP
      ON UPDATE CURRENT_TIMESTAMP;
      COMMIT;
      call insert_log(0, 'check_index_structures', 'column "updated" added to table entities');
      UPDATE entities
      set updated = now();
      COMMIT;
      CREATE INDEX entities_updated
        on entities (updated);
      COMMIT;
    end if;
    if exists_column('entities', 'indexed') = 0
    then
      alter table entities
        add column indexed timestamp default '1974-04-25 00:00:01';
      COMMIT;
      call insert_log(0, 'check_index_structures', 'column "indexed" added to table entities');
      CREATE INDEX entities_indexed
        on entities (indexed);
      COMMIT;
    end if;
  END ;;
