CREATE DEFINER=`root`@`%` PROCEDURE `check_linking_structures`()
BEGIN
    DECLARE n INTEGER;

    SELECT count(*)
    INTO n
    FROM syspar
    WHERE pname LIKE 'rl.%';
    IF n = 0
    THEN
      CALL linking_params_init();
    END IF;
    IF exists_table('lcandidates') = 0
    THEN
      CALL create_linking_tables();
    END IF;

    IF exists_table('ledges') <> 0 AND exists_column('ledges', 'etype') = 0
    THEN
      ALTER TABLE ledges
        ADD COLUMN etype SMALLINT;
      CALL syslog(0, 'adding original etype to existing ledges table', 'DONE.');
      COMMIT;
    END IF;

    IF exists_table('nvalue_info') <> 0 AND exists_index('nvalue_info', 'nvalue_info_attribute_value') = 0
    THEN
      CREATE INDEX nvalue_info_attribute_value
        ON nvalue_info (aTTRIBUTE, nvalue);
      COMMIT;
    END IF;
    IF exists_table('nvalue_info') <> 0 AND exists_index('nvalue_info', 'nvalue_info_value') = 0
    THEN
      CREATE INDEX nvalue_info_value
        ON nvalue_info (nvalue);
      COMMIT;
    END IF;
    IF exists_table('nvalue_info') <> 0 AND exists_column('lgraphs', 'origin') = 0
    THEN
      ALTER TABLE lgraphs
        ADD COLUMN origin VARCHAR(64);
      COMMIT;
      UPDATE lgraphs, linklog
      SET origin = instance
      WHERE lgraphs.id = linklog.graph AND text = 'MAKE_GRAPH: START';
      COMMIT;
      CALL syslog(0, 'adding original column to existing lgraphs table', 'DONE.');
    END IF;
    IF exists_table('linklog') <> 0 AND exists_index('linklog', 'llog_graph') = 0
    THEN
      CREATE INDEX llog_graph
        ON linklog (graph);
      CALL syslog(0, 'adding index on graph to linklog', 'DONE.');
      COMMIT;
    END IF;
    IF exists_table('linklog') <> 0 AND exists_index('linklog', 'llog_instance') = 0
    THEN
      CREATE INDEX llog_instance
        ON linklog (instance);
      CALL syslog(0, 'adding index on instance to linklog', 'DONE.');
      COMMIT;
    END IF;
    IF exists_table('linklog') <> 0 AND exists_index('linklog', 'llog_param') = 0
    THEN
      CREATE INDEX llog_param
        ON linklog (param);
      CALL syslog(0, 'adding index on param to linklog', 'DONE.');
      COMMIT;
    END IF;

    IF exists_table('candidates') <> 0 AND exists_column('candidates', 'n') = 0
    THEN
      ALTER TABLE candidates
        ADD COLUMN n INTEGER COMMENT 'serial number of the candidate inside the graph';
      CALL syslog(0, 'adding n column to candidates table', 'DONE.');
      COMMIT;
    END IF;
    IF exists_table('candidates') <> 0 AND exists_column('candidates', 'org_dist') = 0
    THEN
      ALTER TABLE candidates
        ADD COLUMN org_dist INTEGER COMMENT 'distance of this candidate to the original occurence of this graph';
      CALL syslog(0, 'adding org_dist column to candidates table', 'DONE.');
      COMMIT;
    END IF;
    IF exists_table('rlinks') = 0
    THEN
      DROP TABLE IF EXISTS rlinks;
      CREATE OR REPLACE VIEW rlinks AS
        SELECT
          rid,
          instance,
          the_class,
          description,
          user,
          status,
          rule,
          obs
        FROM
          links, rentities
        WHERE rid = id;
    END IF;
    IF exists_table('ncandidates') <> 0 AND exists_column('ncandidates', 'sex') = 0
    THEN
      DROP TABLE IF EXISTS ncandidates;
      CREATE OR REPLACE VIEW ncandidates AS
        SELECT
          graph,
          candidates.n,
          instance AS id_instance,
          name,
          clust,
          robject,
          status,
          sex
        FROM
          candidates, persons
        WHERE candidates.instance = persons.id;
      CALL syslog(0, 'adding sex column to ncandidates view', 'DONE.');
    END IF;
    IF exists_table('cledges') = 0 OR (exists_table('cledges') <> 0 AND exists_column('cledges', 'org_dista') = 0)
    THEN
      DROP TABLE IF EXISTS cledges;
      CREATE OR REPLACE VIEW cledges AS
        SELECT
          l.graph,
          instanceA,
          instanceB,
          l.status,
          l.etype,
          l.bweight,
          l.bweight2,
          c1.clust    AS clustA,
          c2.clust    AS clustB,
          c1.n        AS na,
          c2.n        AS nb,
          c1.org_dist AS org_dista,
          c2.org_dist AS org_distb,
          c1.status   AS statusa,
          c2.status   AS statusb,
          c1.robject  AS robjecta,
          c2.robject  AS robjectb
        FROM ledges l
          LEFT JOIN candidates c1 ON (c1.instance = l.instancea)
          LEFT JOIN candidates c2 ON (c2.instance = l.instanceb);
      CALL syslog(0, 'adding cledges view', 'DONE.');
    END IF;

  END ;;
DELIMITER ;
