CREATE DEFINER=`root`@`%` PROCEDURE `check_network_structures`()
BEGIN

    CALL insert_log(1, 'check_network_structures', 'checking...');
    DROP TABLE IF EXISTS distinct_edges;
    DROP VIEW IF EXISTS distinct_edges;
    IF exists_table('nodes') = 0
    THEN
      CREATE TABLE nodes (
        netid     VARCHAR(64),
        user      VARCHAR(254),
        node      INTEGER,
        nodeid    VARCHAR(64),
        nodelabel VARCHAR(254),
        nodevalue INTEGER,
        visited   BOOLEAN
      );
      CREATE INDEX nodes_netid
        on nodes (netid);
      CREATE INDEX nodes_nodesid
        on nodes (nodeid);
    /*
