    THEN
      ALTER TABLE nodes
        ADD COLUMN user VARCHAR(64),
        ADD INDEX (user);
      CALL insert_log(0, 'check_network_structures', 'column user and index added to table nodes');
    END IF;

    IF exists_table('edges') = 0
    THEN
      CREATE TABLE edges (
        netid     VARCHAR(64),
        nodea     INTEGER,
        nodeaid   VARCHAR(64),
        nodeb     INTEGER,
        nodebid   VARCHAR(64),
        edgevalue INTEGER,
        label     VARCHAR(254),
        rule      VARCHAR(254),
        the_date  VARCHAR(24)
      );
      CREATE INDEX edges_netid
        on edges (netid);
      CREATE INDEX edges_nodeaid
        on edges (nodeaid);
      CREATE INDEX edges_nodebid
        on edges (nodebid);
      CREATE INDEX edges_label
        on edges (label);
      CREATE INDEX edges_rule
        on edges (rule);
      CREATE INDEX edges_date
        on edges (the_date);

    /*
    *echo* Network table EDGES created
    */

    END IF;
    IF exists_table('tobelinked') = 0
    THEN
      CREATE table tobelinked (
        netid VARCHAR(64),
        id    VARCHAR(64)
      );
      create view distinct_edges as
        select distinct
          netid,
          nodea,
          nodeb,
          label
        from edges;
      CREATE INDEX tbl_net
        ON tobelinked (netid);
      CREATE INDEX tbl_id
        ON tobelinked (id);


    END IF;
    CALL insert_log(1, 'check_network_structures', 'checked');
  END ;;
