CREATE DEFINER=`root`@`%` PROCEDURE `check_rel_equivalences`()
BEGIN
    DECLARE lang VARCHAR(12);

    IF exists_table('rel_equivalences') = 0 OR
       exists_table('irelations') = 0 OR
       exists_table('inrelations') = 0 OR
       exists_table('inrels') = 0 OR
       exists_table('nrelations') = 0 OR
       exists_table('ego_relations') = 0 OR
       exists_table('rperson_nrelations') = 0 OR
       exists_table('rperson_inrelations') = 0 OR
       exists_table('rperson_relations') = 0
    THEN
        CALL create_rel_equivalences_table();
        CALL syslog(0, 'check_rel_equivalences', 'tables and views created');
        CALL init_rel_equivalences();
        SET lang := get_par('rl.language');
        CALL rel_equivalences(lang);
        CALL syslog(0, 'check_rel_equivalences', 'rel_equivalences initialized.');
    END IF;
    CALL syslog(0, 'check_rel_equivalences', 'initialiasing rel_equivalences ');
    CALL init_rel_equivalences();
    IF exists_table('ego_relations') = 0
    THEN
        -- this is because it was a late addition.
        DROP TABLE IF EXISTS ego_relations;
        CREATE OR REPLACE VIEW ego_relations AS
        SELECT *
        FROM irelations
        UNION
        SELECT *
        FROM normalized_relations;
        CALL syslog(0, 'check_rel_equivalences', 'ego_relations view created.');
        COMMIT;
    END IF;
    IF exists_table('rperson_relations') = 0
    THEN
        -- this is because it was a late adition.
        DROP TABLE IF EXISTS rperson_relations;
        CREATE OR REPLACE VIEW rperson_relations AS
        SELECT rid,
               origin,
               destination,
               the_date,
               the_type,
               the_value,
               obs
        FROM links,
             ego_relations
        WHERE instance = destination;
        CALL syslog(0, 'check_rel_equivalences', 'rperson_relations view created.');
    END IF;

END ;;
