        ON rentities (the_class);


        value ('rentity', 'id', 'id', 'id', 'varchar', 64, 0, 1);
      values ('rentity', 'the_class', 'the_class', 'class', 'varchar', 64, 0, 0);
        value ('rentity', 'description', 'description', 'desc', 'varchar', 128, 0, 0);
      values ('rentity', 'user', 'user', 'user', 'varchar', 64, 0, 0);
        value ('rentity', 'status', 'status', 'status', 'char', 1, 0, 0);
      values ('rentity', 'user', 'user', 'user', 'varchar', 64, 0, 0);
        value ('rentity', 'obs', 'obs', 'obs', 'text', 16000, 0, 0);
      COMMIT;

      CALL insert_log(0, 'check_rentities_table', 'rentities table created.');
        SELECT
          id,
          'rperson',
          sname,
          status,
          @user,
          obs
        FROM rpersons;
      COMMIT;
      CALL insert_log(0, 'check_rentities_table', 'rentities table filled with rperson entries.');
        SELECT
          id,
          'robject',
          sname,
          status,
          @user,
          obs
        FROM robjects;
      COMMIT;
      CALL insert_log(0, 'check_rentities_table', 'rentities table filled with robjects entries.');
    END IF;
    /* Make sure that rperson and robject have rentity as their super classe */
    UPDATE classes SET super = 'rentity' WHERE id='rperson' OR id='robject';
    /* fix a bug in the db initialization code */
    UPDATE entities SET id='rentity' WHERE id='rentities' AND class='class';
    commit;
    IF column_size('rentities', 'obs') < 16000
    THEN
