CREATE DEFINER=`root`@`%` PROCEDURE `check_robjects_table`()
BEGIN
    CALL insert_log(1, 'check_robjects_table', 'checking...');
    IF exists_table('robjects') = 0
    THEN
        /* ROBJECT:identifying things.They share the same link table with rpersons */
        CREATE TABLE robjects
        (
            id       varchar(64) primary key,
            seq      INT UNSIGNED NOT NULL AUTO_INCREMENT,
            INDEX (seq),
            sname    varchar(64),
            status   char(1),
            the_type varchar(32),
            user     varchar(64),
            obs      varchar(16000)
        );

        CREATE INDEX robjects_name
            ON robjects (sname);
        CREATE INDEX robjects_user ON robjects (user);

    END IF;
    IF exists_column('robjects', 'seq') = 0
    THEN
        ALTER TABLE robjects
            ADD COLUMN seq INT UNSIGNED NOT NULL AUTO_INCREMENT,
            ADD INDEX (seq);
        CALL insert_log(0, 'check_robjects_table', 'column seq and index added to table robjects');
    END IF;
    IF exists_column('robjects', 'user') = 0
    THEN
        ALTER TABLE robjects
            ADD COLUMN user VARCHAR(64),
            ADD INDEX (user);
        COMMIT;
        UPDATE robjects AS ro
            INNER JOIN rentities as re ON ro.id = re.id
        SET ro.user = re.user;
        CALL insert_log(0, 'check_robjects_table', 'column user and index added to table robjects');
    END IF;
    IF exists_index('robjects', 'robjects_user') = 0 THEN
        CREATE INDEX robjects_user ON robjects (user);
        CALL insert_log(0, 'check_robjects_table', 'index user added to table robjects');

    END IF;


    DELETE FROM class_attributes WHERE the_class = 'robject';

    values ('robject', 'id', 'id', 'id', 'varchar', 64, 0, 1);
        value ('robject', 'sname', 'sname', 'sname', 'varchar', 64, 0, 0);
    values ('robject', 'type', 'the_type', 'type', 'varchar', 32, 0, 0);
        value ('robject', 'user', 'user', 'user', 'varchar', 64, 0, 0);
    values ('robject', 'obs', 'obs', 'obs', 'varchar', 16000, 0, 0);

    IF column_size('robjects', 'obs') < 16000
    THEN
        ALTER TABLE robjects
            MODIFY column obs varchar(16000);
        CALL insert_log(0, 'check_robjects_table', 'column obs size set to 16000');
    end if;


    CALL insert_log(1, 'check_robjects_table', 'checked');
END ;;
