CREATE DEFINER=`root`@`%` PROCEDURE `check_rpersons_table`()
BEGIN
    CALL insert_log(1, 'check_rpersons_table', 'checking...');

    /* check if we have the classes table */
    IF exists_table('rpersons') = 0
    THEN
        /* create table rpersons */
        CREATE TABLE rpersons
        (
            id     varchar(64) primary key,
            seq    INT UNSIGNED NOT NULL AUTO_INCREMENT,
            INDEX (seq),
            sname  varchar(64),
            sex    char(1),
            status char(1),
            user   varchar(64),
            obs    varchar(16000)
        );

        CREATE INDEX rpersons_sname
            ON rpersons (sname);
        CREATE INDEX rpersons_user ON rpersons (user);

        CALL insert_log(0, 'check_rentities_table', 'rpersons table created');
        COMMIT;
    END IF;
    IF exists_column('rpersons', 'seq') = 0
    THEN
        ALTER TABLE rpersons
            ADD COLUMN seq INT UNSIGNED NOT NULL AUTO_INCREMENT,
            ADD INDEX (seq);
        CALL insert_log(0, 'check_rentities_table', 'column seq and index added to table rpersons');
    END IF;
    IF exists_column('rpersons', 'user') = 0
    THEN
        ALTER TABLE rpersons
            ADD COLUMN user VARCHAR(64),
            ADD INDEX (user);
        COMMIT;
        UPDATE rpersons AS rp
            INNER JOIN rentities as re ON rp.id = re.id
        SET rp.user = re.user;
        CALL insert_log(0, 'check_rpersons_table', 'column user and index added to table rpersons');
    END IF;



    DELETE FROM class_attributes WHERE the_class = 'rperson';

    values ('rperson', 'id', 'id', 'id', 'varchar', 64, 0, 1);
    values ('rperson', 'sname', 'sname', 'sname', 'varchar', 64, 0, 0);
    values ('rperson', 'sex', 'sex', 'sex', 'char', 1, 0, 0);
    values ('rperson', 'status', 'status', 'status', 'char', 1, 0, 0);
    values ('rperson', 'obs', 'obs', 'obs', 'text', 16000, 0, 0);


    IF column_size('rpersons', 'obs') < 16000
    THEN
        ALTER TABLE rpersons
            MODIFY column obs varchar(16000);
        CALL insert_log(0, 'check_rpersons_table', 'column obs size set to 16000');
    end if;

    CALL insert_log(1, 'check_rpersons_table', 'checked');
END ;;
