CREATE DEFINER=`root`@`%` PROCEDURE `check_system_structures`()
BEGIN
    CALL insert_log(1, 'check_system_structures', 'checking...');

    IF exists_table('SYSPAR') = 1 AND exists_table('syspar') = 0
    THEN
      CREATE TABLE temp_syspar SELECT *
                               FROM SYSPAR;
      DROP TABLE SYSPAR;
      CREATE TABLE syspar SELECT *
                          FROM temp_syspar;
      DROP TABLE temp_syspar;
      CALL insert_log(0, 'check_system_structures', 'SYSPAR table renamed to syspar ');
    ELSE
      IF exists_table('SYSPAR') = 1 AND exists_table('syspar') = 1
      THEN
        CALL insert_log(-1, 'check_system_structures',
                        'ERROR: both SYSPAR and syspar table exist. Only syspar should exist');
      END IF;
    END IF;

    IF exists_table('SYSLOG') = 1 AND exists_table('syslog') = 0
    THEN
      CREATE TABLE temp_syslog SELECT *
                               FROM SYSLOG;
      DROP TABLE SYSLOG;
      CREATE TABLE syslog SELECT *
                          FROM temp_syslog;
      DROP TABLE temp_syslog;
      CALL insert_log(0, 'check_system_structures', 'SYSLOG table renamed to syslog ');
    ELSE
      IF exists_table('SYSLOG') = 1 AND exists_table('syslog') = 1
      THEN
        CALL insert_log(-1, 'check_system_structures',
                        'ERROR: both SYSLOG and syslog table exist. Only syslog should exist');
      END IF;
    END IF;

    IF exists_table('SYSOUT') = 1 AND exists_table('sysout') = 0
    THEN
      CREATE TABLE temp_sysout SELECT *
                               FROM SYSOUT;
      DROP TABLE SYSOUT;
      CREATE TABLE sysout SELECT *
                          FROM temp_sysout;
      DROP TABLE temp_sysout;
      CALL insert_log(0, 'check_system_structures', 'SYSOUT table renamed to sysout ');
    ELSE
      IF exists_table('SYSOUT') = 1 AND exists_table('sysout') = 1
      THEN
        CALL insert_log(-1, 'check_system_structures',
                        'ERROR: both SYSOUT and sysout table exist. Only sysout should exist');
      END IF;
    END IF;

    IF exists_column('syspar', 'obs') = 0
    THEN
      ALTER TABLE syspar
        ADD COLUMN obs VARCHAR(2048);
      CALL insert_log(0, 'check_system_structures', 'column obs added to table syspar');
    END IF;

    /* This checks if bootstrapping tables exist */
    CALL check_entities_table();
    CALL check_classes_table();
    CALL check_attributes_table();
    CALL check_relations_table();
    CALL check_sources_table();
    CALL check_acts_table();
    CALL check_persons_table();
    CALL check_objects_table();
    CALL check_links_table();
    CALL check_rpersons_table();
    CALL check_robjects_table();
    CALL check_geoentities_structures();
    CALL check_rentities_table(); /* must go after the other specialized rpersons and robjects */
    call check_linking_structures();
    call check_index_structures();
    -- DEPRECATED call check_family_structures();
    CALL check_network_structures();

    CALL insert_log(1, 'check_system_structures', 'ALL CHECKS MADE.');

    CALL insert_log(1, 'check_system_structures', 'checked');
    /*

    *echo* CREATE PROCEDURE check_system_structures()

    */
  END ;;
DELIMITER ;
