CREATE DEFINER=`root`@`%` PROCEDURE `cluster_to_rperson`(graph_id VARCHAR(64),vcluster INTEGER, user_id VARCHAR(64), out vrid VARCHAR(64))
BEGIN
	DECLARE occ VARCHAR(64);
	DECLARE vsname VARCHAR(128);
	DECLARE vsex VARCHAR(1);
	DECLARE n SMALLINT;
	DECLARE end_of_cursor SMALLINT DEFAULT 0;
	DECLARE c CURSOR FOR select distinct instance from rlinks where instance in
			(select instance from candidates where graph=graph_id and clust=vcluster)
			AND
				user=user_id;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;	
	
	/* First we unlink any occurrence existing in this cluster */

	CALL llog(graph_id,vcluster,user_id,'CLUSTER_TO_RPERSON: START');
	SET end_of_cursor := 0;
	OPEN c;
	FETCH c into occ;
	WHILE (end_of_cursor=0) DO		
		call remove_occurrence_for_user(occ,user_id);
		FETCH c into occ;
	END WHILE;
	
	/* we must now get the name for the new real person: we fetch the most frequent one */

	select name,count(*) into vsname,n from ncandidates where graph=graph_id and clust=vcluster group by name order by 2 desc limit 1;
	
	/* we must also get the sex right */

	select sex into vsex from ncandidates where graph=graph_id and clust=vcluster limit 1;
	
	/* now we creatre the real person */

	call insert_rperson(vsname,vsex,'G',user_id,concat('created from linking graph ',graph_id,' cluster ',vcluster),vrid);
	
	/* we now insert the links */

	-- describe links
				graph=graph_id and clust=vcluster ;
	/* we now sotre the real person id in the candidates table*/

	update candidates set robject=vrid where graph=graph_id and clust=vcluster;
	commit;
	CALL llog(graph_id,vcluster,vrid,'CLUSTER_TO_RPERSON: STOP');
	
END ;;
DELIMITER ;
