CREATE DEFINER=`root`@`%` PROCEDURE `cmp_person`(IN personA VARCHAR(64), IN personB VARCHAR(64), OUT the_result FLOAT)
BEGIN
    DECLARE matched BOOLEAN DEFAULT 0;
    DECLARE cbw FLOAT DEFAULT 0;
    DECLARE binit FLOAT DEFAULT 0;
    DECLARE binitA FLOAT DEFAULT 0;
    DECLARE binitB FLOAT DEFAULT 0;
    DECLARE posbw FLOAT DEFAULT 0;
    DECLARE negbw FLOAT DEFAULT 0;
    DECLARE last_attribute VARCHAR(32) DEFAULT ' ';
    DECLARE last_valueA VARCHAR(254) DEFAULT ' ';
    DECLARE last_valueB VARCHAR(254) DEFAULT ' ';
    DECLARE cv FLOAT;
    DECLARE atrib, atribB VARCHAR(32);
    DECLARE valueA, valueB, nvalueA, nvalueB VARCHAR(254);
    DECLARE rfreqA, rfreqB, pnotlinkA, pnotlinkB, apnotlinkA, apnotlinkB FLOAT(7, 6);
    DECLARE pnlcasesA, pnlcasesB INTEGER;
    DECLARE idA, idB VARCHAR(254);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE allAttributes CURSOR FOR
      SELECT
        c1.attribute atrib,
        c2.attribute atribB,
        c1.value     valueA,
        c2.value     valueB,
        c1.nvalue    nvalueA,
        c2.nvalue    nvalueB,
        c1.rfreq     rfreqA,
        c2.rfreq     rfreqB,
        c1.pnlcases  pnlcasesA,
        c2.pnlcases  pnlcasesB,
        c1.pnotlink  pnotlinkA,
        c2.pnotlink  pnotlinkB,
        c1.apnotlink apnotlinkA,
        c2.apnotlink apnotlinkB,
        c1.id        idA,
        c2.id        idB
      FROM
        cache c1,
        cache c2
      WHERE
        c1.person = personA AND c2.person = personB AND
        ((c1.attribute = c2.attribute)
         OR
         (c1.attribute IN ('apelido', 'alcunha')
          AND
          c2.attribute IN ('apelido', 'alcunha'))
         OR
         (c1.attribute IN ('cargo', 'profissao')
          AND
          c2.attribute IN ('cargo', 'profissao'))
         OR
         (c1.attribute IN ('residencia', 'residiu')
          AND
          c2.attribute IN ('residencia', 'residiu'))
        ) AND
        find_in_set(c1.attribute, get_par('rl.attributes.ignored.for.match')) = 0
      ORDER BY c1.attribute, c1.value, c2.value;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    CALL syslog(4, concat('cmp_person(', personA, ', ', personB, ')'), 'START');

    /* get the atributes to the cache */

    CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), 'insert_in_cache(personA)');

    CALL insert_in_cache(personA);
    CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), 'insert_in_cache(personB)');
    CALL insert_in_cache(personB);
    CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), 'insert_in_cache DONE');

    /* this loops a line FOR each value pair */

    OPEN AllAttributes;
    FETCH AllAttributes
    INTO atrib, atribB, valueA, valueB, nvalueA, nvalueB,
      rfreqA, rfreqB, pnlcasesA, pnlcasesB, pnotlinkA, pnotlinkB,
      apnotlinkA, apnotlinkB, idA, idB;
    WHILE (end_of_cursor = 0) DO
      -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('VALUES ', atrib,'/',valueA,'/',valueB));
      -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('		valor A=' , valueA , ' valorB=' , valueB));
      -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),'nvalues: ');
      -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('		valorA=',nvalueA, ' valorB=' ,nvalueB));
      IF atrib <> last_attribute
      THEN
        IF matched
        THEN
          SET cbw = cbw + posbw;
          CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'),
                      concat('POSITIVE contribute of ', last_attribute, "/", last_valueA, '<->', last_valueB, '=',
                             posbw));
        ELSE
          SET cbw = cbw + negbw;
          CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'),
                      concat('NEGATIVE contribute of ', last_attribute, "/", last_valueA, '<->', last_valueB, '=',
                             negbw));
        END IF;
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat(' (cbw) = ',cbw));
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('new:',atrib));
        SET posbw = 0;
        SET negbw = 0;
        SET matched = 0;
        SET last_attribute = atrib;
        SET last_valueA = ' ';
        SET last_valueB = ' ';
      END IF;
      IF last_valueA <> valueA OR last_valueB <> valueB
      THEN
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),'** New val pair ');
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),valueA);
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),valueB);
        IF last_valueA = valueA
        THEN
          CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), 'same valueA.');
        END IF;

        SET cv = cmp_attribute(atrib, nvalueA, nvalueB, idA, idB);
        /* Nota: se o cmp_atribute devolve zero nao conta */

        IF cv = 0
        THEN
          SET binit = 0;
        ELSE
          SET binitA = bw(rfreqA, pnotlinkA, apnotlinkA, pnlcasesA, cv);
          SET binitB = bw(rfreqB, pnotlinkB, apnotlinkb, pnlcasesB, cv);
          IF cv > 0
          THEN -- se tirar este if o sistema torna-se menos rigoroso nas discordancias
            SET binit = if(binitA > binitB, binitA, binitB);
          ELSEIF cv < 0
            THEN
              SET binit = if(binitA < binitB, binitA, binitB);
          END IF;
        END IF;
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('(cv) = ',(cv)));
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('binit = ' , (binit)));
        IF cv > 0
        THEN
          SET matched = 1;
          SET posbw = posbw + binit;
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),'Positive.');
        ELSE /* o teste seguinte evita duplas contagens */

          IF last_valueA <> valueA AND last_valueB <> valueB
          THEN
            SET negbw = negbw + binit;
          -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),'negative.');
          ELSE
            CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), 'nao contam (repeticao).');
          END IF;
        END IF;
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('(posbw) = ',(posbw)));
        -- CALL syslog(5,concat('cmp_person(',personA,', ',personB,')'),concat('(negbw) = '||(negbw)));

        SET last_valueA = valueA;
        SET last_valueB = valueB;
      END IF;
      FETCH AllAttributes
      INTO atrib, atribB, valueA, valueB, nvalueA, nvalueB,
        rfreqA, rfreqB, pnlcasesA, pnlcasesB, pnotlinkA, pnotlinkB,
        apnotlinkA, apnotlinkB, idA, idB;
    END WHILE;
    IF matched
    THEN
      CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'),
                  concat('POSITIVE contribute of ', last_attribute, "/", last_valueA, '<->', last_valueB, '=', posbw));
      SET cbw = cbw + posbw;
    ELSE
      SET cbw = cbw + negbw;
      CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'),
                  concat('NEGATIVE contribute of ', last_attribute, "/", last_valueA, '<->', last_valueB, '=', negbw));
    END IF;
    CALL syslog(5, concat('cmp_person(', personA, ', ', personB, ')'), concat('final (cbw) = ', (cbw)));
    CALL syslog(4, concat('cmp_person(', personA, ', ', personB, ')'), 'STOP');

    SET the_result = cbw;
  END ;;
DELIMITER ;
