CREATE DEFINER=`root`@`%` PROCEDURE `continue_graph`(graph_id VARCHAR(64),threshold FLOAT(7,4))
BEGIN
 	DECLARE cand  VARCHAR(64) DEFAULT NULL;
	DECLARE original VARCHAR(64) DEFAULT NULL;

		SELECT origin into original from lgraphs where id=graph_id;

	CALL llog(graph_id,original,original,'MAKE_GRAPH: CONTINUE');
	
	COMMIT;
	UPDATE candidates SET status='N' WHERE status='S' AND graph=graph_id;
	COMMIT;
	/* expandir */

	REPEAT
	  	SELECT min(instance) INTO cand FROM candidates WHERE status='N' AND graph=graph_id order by n;
		IF cand IS NOT NULL THEN
			IF original IS NULL THEN
				set original = cand;
			END IF;
			CALL expand_lnode(graph_id,original, cand,threshold);
		END IF;
	UNTIL cand IS NULL END REPEAT;
	/* preencher os eventuais buracos */

	CALL fill_graph(graph_id,threshold);
	CALL llog(graph_id,original,original,'MAKE_GRAPH: STOP');
END ;;
DELIMITER ;
