CREATE DEFINER=`root`@`%` PROCEDURE `cont_update_nvalues_info`()
BEGIN
    DECLARE an_attribute VARCHAR(32);
    DECLARE a_nvalue VARCHAR(254);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE LastRun DATE;
    DECLARE a_cursor CURSOR FOR
      SELECT
        attribute,
        nvalue
      FROM nvalue_info
      Where lastUpdate is null or lastUpdate < LastRun;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    CALL insert_log(2, 'cont_update_nvalues_info:', 'START');
    SELECT max(lastUpdate)
    into LastRun
    FROM nvalue_info;
    CALL insert_log(2, 'cont_update_nvalues_info:', concat('Last run was ', LastRun));
    OPEN a_cursor;
    FETCH a_cursor
    into an_attribute, a_nvalue;
    WHILE (end_of_cursor = 0) DO
      IF end_of_cursor = 0
      THEN
        CALL insert_log(3, 'cont_update_nvalues_info:', concat(an_attribute, "/", a_nvalue));
        CALL update_nvalue_info(an_attribute, a_nvalue, now());
      END IF;
      FETCH a_cursor
      into an_attribute, a_nvalue;
    END WHILE;
    CALL insert_log(2, 'cont_update_nvalues_info:', 'DONE');
  END ;;
DELIMITER ;
