CREATE DEFINER=`root`@`%` PROCEDURE `convert_tables_to_utf8`()
BEGIN
    DECLARE var1 CHAR(50);
    DECLARE done TINYINT DEFAULT FALSE;
    DECLARE cursor1
        CURSOR FOR
        SELECT table_name FROM information_schema.tables where table_schema = database() AND table_type='BASE TABLE';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    SET foreign_key_checks=0;
    OPEN cursor1;
    my_loop:
    LOOP
        FETCH cursor1 INTO var1;
        IF done THEN
            LEAVE my_loop;
        ELSE
            SET @SQL = CONCAT('ALTER TABLE `', var1, '` CONVERT TO CHARACTER SET utf8mb4');
            PREPARE stmt FROM @SQL;
            EXECUTE stmt;
            CALL insert_log(1, 'convert_tables_to_utf8',CONCAT('Table ',var1,' converted to utf8mb4'));
            DEALLOCATE PREPARE stmt;
        END IF;
    END LOOP;
    SET foreign_key_checks = 1;
END ;;
DELIMITER ;
