CREATE DEFINER=`root`@`%` PROCEDURE `create_linking_tables`()
BEGIN
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION BEGIN

    END;
    IF exists_table('lgraphs') = 0
    THEN
      CREATE TABLE IF NOT EXISTS lgraphs (
        id     VARCHAR(64) PRIMARY KEY,
        CONSTRAINT fk_lgraphs_entities FOREIGN KEY (id) REFERENCES entities (id),
        origin VARCHAR(64) COMMENT 'original occurence that started the graph',
        status CHAR(1) COMMENT 'not sure what this is for.'
      )
        ENGINE = InnoDB
        COMMENT ='Linking graphs. Used during the record linking process to decide between similar persons.';

      DELETE FROM classes
      WHERE id = 'lgraph';
      DELETE FROM entities
      WHERE id = 'lgraph';
      VALUES ('lgraph', 'lgraphs', 'lgraph', 'entity');
      COMMIT;
    END IF;

    IF exists_table('candidates') = 0
    THEN
      CREATE TABLE IF NOT EXISTS candidates (
        graph    VARCHAR(64),
        CONSTRAINT fk_candidates_graphs FOREIGN KEY (graph) REFERENCES lgraphs (id),
        instance VARCHAR(64),
        CONSTRAINT fk_candidates_entities FOREIGN KEY (instance) REFERENCES entities (id),
        clust    SMALLINT,
        robject  VARCHAR(64),
        -- currently disabled because robject - rpersons specialization not enforced in MHK
        -- CONSTRAINT fk_candidates_entities FOREIGN KEY REFERENCES entities(id) ,
        status   CHAR(1) COMMENT 'V=visited, N=not visited, S=suspended',
        n        INTEGER COMMENT 'serial number of the candidate inside the graph'
      )
        ENGINE = InnoDB;
      CREATE INDEX CAND_GRAPH_NDX
        ON candidates (graph);
      CREATE INDEX CAND_INST
        ON candidates (instance);
      CREATE INDEX CAND_robject
        ON candidates (robject);
    END IF;

    DROP TABLE IF EXISTS ncandidates;
    CREATE OR REPLACE VIEW ncandidates AS
      SELECT
        graph,
        n,
        instance AS id_instance,
        name,
        clust,
        robject,
        status,
        sex
      FROM
        candidates, persons
      WHERE candidates.instance = persons.id;

    DROP TABLE IF EXISTS rcandidates;
    CREATE OR REPLACE VIEW rcandidates AS
      SELECT
        graph               AS id_graph,
        clust,
        rid                 AS idrp,
        candidates.n,
        candidates.instance AS id_cand,
        name,
        rule
      FROM candidates
        LEFT JOIN persons ON (candidates.instance = persons.id)
        LEFT JOIN links ON (candidates.instance = links.instance);

    DROP TABLE IF EXISTS lcandidates;
    CREATE OR REPLACE VIEW lcandidates AS
      SELECT
        rid,
        graph               AS id_graph,
        clust,
        links.instance      AS id_instance,
        candidates.n,
        candidates.instance AS id_cand,
        name,
        rule
      FROM links
        LEFT JOIN persons ON (links.instance = persons.id)
        LEFT JOIN candidates ON (links.instance = candidates.instance);

    DROP TABLE IF EXISTS rpersons_to_lgraphs;
    CREATE OR REPLACE VIEW rpersons_to_lgraphs AS
      SELECT
        l1.rid                  AS rid,
        l1.instance             AS id_instance,
        ncandidates.id_instance AS id_cand,
        ncandidates.graph       AS graph,
        ncandidates.clust       AS clust,
        ncandidates.name        AS name
      FROM (links l1 LEFT JOIN ncandidates ON ((l1.instance = ncandidates.id_instance)))
      WHERE l1.rid IN
            (SELECT l2.rid AS rid
             FROM links l2
             WHERE l2.instance
                   IN (SELECT candidates.instance AS instance
                       FROM candidates))
      ORDER BY l1.rid, l1.instance, l1.instance;

    DROP TABLE ledges;
    IF exists_table('ledges') = 0
    THEN
      CREATE TABLE IF NOT EXISTS ledges (
        graph     VARCHAR(64) REFERENCES lgraphs (id),
        CONSTRAINT fk_ledges_graphs FOREIGN KEY (graph) REFERENCES lgraphs (id),
        instanceA VARCHAR(64) REFERENCES entities (id),
        -- disabled to avoid errors during reimport of sources
        -- CONSTRAINT fk_ledges_entitiesA FOREIGN KEY (instanceA) REFERENCES entities(id),
        instanceB VARCHAR(64) REFERENCES entities (id),
        -- disabled to avoid erros during the reimport of sources
        -- CONSTRAINT fk_ledges_entitiesB FOREIGN KEY (instanceB) REFERENCES entities(id),
        status    CHAR(1) COMMENT 'G=good edge (above threshold), L=low value edge (bellow threshold but above drop threshold), B=bad edge (bellow drop threshold), T=Tested and failed (violates a Gtest rule)',
        etype     SMALLINT COMMENT '0=both nodes in same cluster,1=nodes not connected, 2=left connected right free, 3=right connected left free',
        bweight   FLOAT(7, 4),
        bweight2  FLOAT(7, 4)
      )
        ENGINE = INNODB;

      CREATE INDEX LEDGES_GRAPH_NDX
        ON ledges (graph);
      CREATE INDEX LEDGES_INSTA
        ON ledges (instanceA);
      CREATE INDEX LEDGES_INSTB
        ON ledges (instanceB);
      CREATE INDEX LEDGES_INSTS
        ON ledges (instanceA, instanceB);

    END IF;

    DROP TABLE IF EXISTS nledges;
    CREATE OR REPLACE VIEW nledges AS
      SELECT
        graph     AS id_graph,
        instanceA AS idA,
        pA.name   AS nameA,
        instanceB AS idB,
        pB.name   AS nameB,
        status,
        bweight,
        bweight2
      FROM
        ledges, persons pA, persons pB
      WHERE
        ledges.instanceA = pA.id AND ledges.instanceB = pB.id;

    IF exists_table('linklog') = 0
    THEN
      CREATE TABLE IF NOT EXISTS linklog (
        seq      INTEGER AUTO_INCREMENT PRIMARY KEY,
        graph    VARCHAR(64),
        --		CONSTRAINT fk_linklog_graphs FOREIGN KEY (graph) REFERENCES lgraphs(id),
        instance VARCHAR(64),
        --		CONSTRAINT fk_linklog_entities FOREIGN KEY (graph) REFERENCES entities(id),
        param    VARCHAR(64),
        text     VARCHAR(2048),
        time     TIMESTAMP
      );

      CREATE INDEX llog_graph
        ON linklog (graph);
      CREATE INDEX llog_instance
        ON linklog (instance);
      CREATE INDEX llog_param
        ON linklog (param);

    END IF;

    DROP TABLE IF EXISTS nlinkinglog;
    CREATE OR REPLACE VIEW nlinklog AS
      SELECT
        linklog.seq      AS seq,
        linklog.graph    AS graph,
        linklog.instance AS id_inst,
        persons.name     AS name,
        linklog.param    AS param,
        linklog.text     AS text,
        linklog.time     AS time
      FROM (linklog
        JOIN persons)
      WHERE (persons.id = linklog.instance);

    DROP TABLE scratch;
    CREATE TABLE scratch (
      id    VARCHAR(64),
      graph VARCHAR(64)
    )
      ENGINE = InnoDB;

    CREATE INDEX scratch_id
      ON scratch (id);
    CREATE INDEX scratch_graph
      ON scratch (graph);


    DROP TABLE IF EXISTS nscratch;
    CREATE OR REPLACE VIEW nscratch AS
      SELECT
        persons.id,
        graph,
        name
      FROM scratch, persons
      WHERE scratch.id = persons.id;

    DROP TABLE cache;
    CREATE TABLE cache
    (
      id        VARCHAR(64),
      person    VARCHAR(64),
      attribute VARCHAR(32),
      value     VARCHAR(254),
      nvalue    VARCHAR(254),
      adate     INTEGER,
      rfreq     FLOAT(7, 6),
      pnotlink  FLOAT(7, 6),
      apnotlink FLOAT(7, 6),
      pnlcases  INTEGER
    );
    CREATE INDEX chache_person_ndx
      ON cache (person);
    CREATE INDEX cache_atribute_ndx
      ON cache (attribute);
    CREATE INDEX cache_vatribute_ndx
      ON cache (attribute, value);

    /* Table that supports the batch processing of indentifications */

    DROP TABLE IF EXISTS link_queue;
    CREATE TABLE link_queue (
      id       VARCHAR(64), /* initial occurence to link */
      status   CHAR(1), /* Q=Queued, P=Processing, D=Done */
      priority SMALLINT, /*  Priority ,the highest number is processed first */
      time     TIMESTAMP
    ) /* last change of this entry */
    ;

    DROP TABLE IF EXISTS nlink_queue;
    CREATE OR REPLACE VIEW nlink_queue AS
      SELECT
        persons.id,
        persons.name,
        status,
        priority,
        time
      FROM link_queue, persons
      WHERE persons.id = link_queue.id;
    CALL syslog(0, 'create_linking_tables', 'DONE.');


    /* Checks related to record linking structures */

    IF exists_constraint('candidates', 'fk_candidates_entities') = 1
    THEN
      CALL insert_log(1, 'create_linking_tables',
                      'dropping constraint on entities in table candidates (can take a few minutes...)');
      ALTER TABLE candidates
        DROP FOREIGN KEY fk_candidates_entities;
      CALL insert_log(0, 'create_linking_tables', 'constraint on entities in table candidates dropped.');
      COMMIT;
    END IF;

    IF exists_constraint('ledges', 'fk_ledges_entitiesA') = 1
    THEN
      CALL insert_log(1, 'create_linking_tables',
                      'dropping constraint on entities in table ledges (A) (can take a long time...)');
      ALTER TABLE ledges
        DROP FOREIGN KEY fk_ledges_entitiesA;
      CALL insert_log(0, 'create_linking_tables', 'constraint on entities in table ledges(A) dropped.');
      COMMIT;
    END IF;
    IF exists_constraint('ledges', 'fk_ledges_entitiesB') = 1
    THEN
      CALL insert_log(1, 'create_linking_tables',
                      'dropping constraint on entities in table ledges (B) (can take a long time...)');
      ALTER TABLE ledges
        DROP FOREIGN KEY fk_ledges_entitiesB;
      CALL insert_log(0, 'create_linking_tables', 'constraint on entities in table ledges (B) dropped.');
      COMMIT;
    END IF;

  END ;;
DELIMITER ;
