CREATE DEFINER=`root`@`%` PROCEDURE `create_nvalue_info_table`()
BEGIN
    DROP TABLE IF EXISTS nvalue_info;
    CREATE TABLE nvalue_info (
      id         int(11) NOT NULL auto_increment,
      attribute  varchar(32)      default NULL,
      nvalue     varchar(254)     default NULL,
      npersons   int(6)           default NULL,
      rfreq      float(7, 6)      default NULL,
      prandom    float(7, 6)      default NULL,
      pnotlink   float(7, 6)      default NULL,
      pnlcases   int(6)           default NULL,
      lastUpdate date             default NULL,
      PRIMARY KEY (id),
      KEY nvalue_info_atribute_ndx (attribute, nvalue),
      KEY nvalue_info_nvalue_ndx (nvalue)
    )
      ENGINE = MyISAM
      DEFAULT CHARSET = latin1;
    create index nvalue_info_attribute_value
      on nvalue_info (aTTRIBUTE, nvalue);
    create index nvalue_info_value
      on nvalue_info (nvalue);
    commit;
  END ;;
