/*!50003 DROP PROCEDURE IF EXISTS `create_rel_equivalences_table` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_general_ci */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `create_rel_equivalences_table`()
BEGIN
    DROP TABLE IF EXISTS rel_equivalences;
    CREATE TABLE rel_equivalences
    (
        the_type   VARCHAR(32) COMMENT 'the type of the relation as it occurs in the data',
        the_ntype  VARCHAR(32) COMMENT 'the type of the relation, normalized',
        the_value  VARCHAR(254) COMMENT 'the relation expressed as A to B, as it occurs in the data - John(A) Was Husband of Mary (B).',
        the_nvalue VARCHAR(254) COMMENT 'the relation expressed as A to B, normalized - John(A) Husband of Mary (B).',
        inv_nvalue VARCHAR(254) COMMENT 'the relation expressed as B to A, normalized - Mary (B) Wife of John(A)',
        sexa       CHAR(1) COMMENT 'sex of A',
        sexb       CHAR(1) COMMENT 'sex of B'
    )
        COMMENT 'Table that registers the equivalence of relations expressed with a person as origin (A) and as destination (B)';
    CREATE INDEX rel_equiv_type_ego_to_x_index
        ON rel_equivalences (the_type, the_value);
    CREATE INDEX rel_equiv_type_x_to_ego_index
        ON rel_equivalences (the_type, inv_nvalue);
    CREATE INDEX rel_equiv_type
        ON rel_equivalences (the_type);
    CREATE INDEX rel_equiv_EgoTox
        ON rel_equivalences (the_value);
    CREATE INDEX rel_equiv_XToEgo
        ON rel_equivalences (inv_nvalue);
    COMMIT;
    CALL syslog(2, 'create_rel_equivalences_table', 'rel_equivalences table created.');

    /* this is the inverted relation table. It inverts the normal relations table through rel_equivalences.
      We use the nrels view instead of relations because to invert relations we need the sex of people involved and so
      a join with the persons table. nrels provides that. This table can be used as a replacement for relations because
      it has the same columns.
    */

    DROP TABLE IF EXISTS irelations;
    CREATE OR REPLACE VIEW irelations AS
    SELECT r.id,
           r.idb         AS origin,
           r.ida         AS destination,
           the_date,
           re.the_ntype  AS the_type,
           re.inv_nvalue AS the_value,
           obs
    FROM nrels r
             LEFT JOIN rel_equivalences re
                       ON (r.the_type = re.the_type AND r.the_value = re.the_value AND re.sexa = r.sexa AND
                           re.sexb = r.sexb);

    CALL syslog(0, 'create_rel_equivalences_table', 'irelations view created.');

    DROP TABLE IF EXISTS rperson_inrelations;
    DROP TABLE IF EXISTS inrelations;
    CREATE OR REPLACE VIEW inrelations AS
    SELECT r.id,
           r.destination AS origin,
           r.origin      AS destination,
           r.the_date,
           re.the_ntype  AS the_type,
           re.inv_nvalue AS the_value,
           r.obs
    FROM relations r,
         rel_equivalences re,
         persons pa,
         persons pb
    WHERE r.origin = pa.id
      AND r.destination = pb.id
      AND r.the_type = re.the_type
      AND r.the_value = re.the_value
      AND pa.sex = re.sexa
      AND pb.sex = re.sexb;

    CALL syslog(0, 'create_rel_equivalences_table', 'inrelations view created.');
    /*
      This is a inverted view of nrels, so relations with name and sex of persons involved. Can be used as a replacement for nrels.
    */

    DROP TABLE IF EXISTS inrels;
    CREATE OR REPLACE VIEW inrels AS
    SELECT r.id,
           r.idb         AS ida,
           nameb         AS namea,
           r.sexb        AS sexa,
           r.ida         AS idb,
           namea         AS nameb,
           r.sexa        AS sexb,
           the_date,
           re.the_ntype  AS the_type,
           re.inv_nvalue AS the_value,
           obs
    FROM nrels r
             LEFT JOIN rel_equivalences re
                       ON (r.the_type = re.the_type AND r.the_value = re.the_value AND re.sexa = r.sexa AND
                           re.sexb = r.sexb);
    CALL syslog(0, 'create_rel_equivalences_table', 'inrels view created.');

    -- this is normal relations table with type and value normalized thorugh -- rel_equivalences
    DROP TABLE IF EXISTS nrelations;
    CREATE OR REPLACE VIEW nrelations AS
    SELECT r.id,
           r.origin,
           r.destination,
           r.the_date,
           the_ntype     AS the_type,
           re.the_nvalue AS the_value,
           r.obs
    FROM relations r,
         rel_equivalences re,
         persons pa,
         persons pb
    WHERE r.origin = pa.id
      AND r.destination = pb.id
      AND r.the_type = re.the_type
      AND r.the_value = re.the_value
      AND pa.sex = re.sexa
      AND pb.sex = re.sexb;

    CALL syslog(0, 'create_rel_equivalences_table', 'nrelations view created.');
    /* this is a join between the inverted relations and the normalized relations views giving in fact all the relations of a person in a single perspective
     */

    DROP TABLE IF EXISTS ego_relations;
    CREATE OR REPLACE VIEW ego_relations AS
    SELECT *
    FROM inrelations
    UNION
    SELECT *
    FROM nrelations;
    CALL syslog(0, 'create_rel_equivalences_table', 'ego_relations view created.');

    DROP TABLE IF EXISTS rperson_nrelations;
    CREATE OR REPLACE VIEW rperson_nrelations AS
    SELECT rid,
           origin,
           destination,
           the_date,
           the_type,
           the_value,
           obs
    FROM links,
         nrelations
    WHERE instance = destination;
    CALL syslog(0, 'create_rel_equivalences_table', 'rperson_nrelations view created.');

    DROP TABLE IF EXISTS rperson_inrelations;
    CREATE OR REPLACE VIEW rperson_inrelations AS
    SELECT rid,
           origin,
           destination,
           the_date,
           the_type,
           the_value,
           obs
    FROM links,
         inrelations
    WHERE instance = destination;
    CALL syslog(0, 'create_rel_equivalences_table', 'rperson_inrelations view created.');

    DROP TABLE IF EXISTS rperson_relations;
    CREATE OR REPLACE VIEW rperson_relations AS
    SELECT rid,
           origin,
           destination,
           the_date,
           the_type,
           the_value,
           obs
    FROM links,
         ego_relations
    WHERE instance = destination;
    CALL syslog(0, 'create_rel_equivalences_table', 'rperson_relations view created.');
END ;;
DELIMITER ;
