CREATE DEFINER=`root`@`%` PROCEDURE `create_views_basic`()
BEGIN

      CALL insert_log(1, 'create_views_basic', 'starting...');
    DROP TABLE IF EXISTS rrirels;
    DROP VIEW IF EXISTS rrirels;
    DROP TABLE IF EXISTS rirels;
    DROP VIEW IF EXISTS rirels;
    DROP TABLE IF EXISTS irels;
    DROP VIEW IF EXISTS irels;
    /*

  This gives the people co-occurring within the same acts.
  It is a support view for rirels.

  */
    CREATE VIEW irels AS
      SELECT
        r1.origin    AS ida,
        r2.origin    AS idb,
        r1.the_value AS funca,
        r2.the_value AS funcb,
        a.id         AS act,
        a.the_type   AS act_type,
        a.the_date   AS act_date
      FROM relations r1, relations r2, acts a
      WHERE r2.destination = r1.destination AND
            r1.the_type = 'function-in-act' AND r1.origin <> r2.origin AND r2.destination = a.id;

    /*

    This gives the occurences of all the people in all the acts of a given real person.

    */
    CREATE VIEW rirels AS
      SELECT
        links.rid,
        irels.ida,
        irels.funca,
        irels.funcb,
        irels.act,
        irels.act_type,
        irels.act_date,
        persons.name,
        irels.idb
      FROM links, irels, persons
      WHERE links.instance = irels.ida AND persons.id = irels.idb;

    /*

    Like rirels but also gives the real id, if any, of the people co-ocurring

    */

    CREATE VIEW rrirels AS
      select
        rirels.rid as rida,
        ida,
        funca,
        funcb,
        name,
        idb,
        act        as id_act,
        act_type,
        act_date,
        links.rid  as ridb
      from rirels
        left join links on (idb = links.instance);

    /*
      persons and real ids if any

    */

    DROP TABLE IF EXISTS lpersons;
    DROP VIEW IF EXISTS lpersons;

    CREATE VIEW lpersons AS
      SELECT
        persons.id,
        persons.name,
        persons.sex,
        persons.obs,
        links.rid,
        rentities.user,
        rentities.status
      FROM persons
        LEFT JOIN links ON persons.id = links.instance
        LEFT JOIN rentities on links.rid = rentities.id;

    /*
      named functions

    */

    DROP TABLE IF EXISTS nfuncs;
    DROP VIEW IF EXISTS nfuncs;
    CREATE VIEW nfuncs AS
      SELECT
        r.origin    AS id,
        p.name,
        r.the_value AS func,
        a.id        AS id_act,
        a.the_type  AS act_type,
        a.the_date  AS act_date
      FROM relations r, persons p, acts a
      WHERE r.the_type = 'function-in-act' AND r.destination = a.id AND r.origin = p.id;

    /*

    named relations

    */

    DROP TABLE IF EXISTS nrels;

    DROP VIEW IF EXISTS nrels;

    CREATE VIEW nrels AS
      SELECT
        relations.id,
        p1.id   AS ida,
        p1.name AS namea,
        p1.sex  as sexa,
        p2.id   AS idb,
        p2.name AS nameb,
        p2.sex  AS sexb,
        relations.the_type,
        relations.the_value,
        relations.the_date,
        relations.obs
      FROM relations, persons p1, persons p2
      WHERE relations.origin = p1.id AND relations.destination = p2.id AND relations.the_type <> 'Identification';

    /*

    named attributes

    */

    DROP TABLE IF EXISTS nattributes;

    DROP VIEW IF EXISTS nattributes;

    /* sex attribute added 16-5-2008. See check_system_structures() in 00_system.sql */

    CREATE VIEW nattributes AS
      SELECT
        p.id,
        p.name,
        p.sex,
        a.the_type,
        a.the_value,
        a.the_date,
        p.obs AS pobs,
        a.obs AS aobs
      FROM attributes a, persons p
      WHERE a.entity = p.id;

    /*
     named function for real persons
     */

    DROP TABLE IF EXISTS rnfuncs;

    DROP VIEW IF EXISTS rnfuncs;

    CREATE VIEW rnfuncs AS
      SELECT
        l.rid,
        r.origin    AS id,
        p.name,
        r.the_value AS func,
        a.id        AS id_act,
        a.the_type  AS act_type,
        a.the_date  AS act_date
      FROM relations r, persons p, acts a, links l
      WHERE r.the_type = 'function-in-act' AND r.destination = a.id
            AND r.origin = p.id AND l.instance = p.id;
      CALL insert_log(1, 'create_views_basic', 'ending.');
  END ;;
DELIMITER ;
