CREATE DEFINER=`root`@`%` PROCEDURE `create_view_casais`()
BEGIN
    DROP TABLE IF EXISTS casais;
    drop view if exists casais;
    create view casais as
    select p1.id   as idmr,
           p1.name as namemr,
           p2.id   as idmer,
           p2.name as namemer,
           attributes.the_value,
           rel.the_date
    from relations rel
             left join persons p1 on (rel.origin = p1.id)
             left join persons p2 on (rel.destination = p2.id)
             left outer join attributes on (attributes.entity = p1.id and attributes.the_type = 'residencia')
    where rel.the_value = 'marido'
       or rel.the_value = 'foi marido'
    order by p1.name, p2.name, attributes.the_value, rel.the_date;
END ;;
