CREATE DEFINER=`root`@`%` PROCEDURE `expand_lnode`(graph_id  VARCHAR(64),
                              original  VARCHAR(64), -- the original occurence from which the current graph started
                              startc    VARCHAR(64), -- the current node in the graph that we are expanding
                              threshold FLOAT(7, 4))
BEGIN
    DECLARE score, drop_threshold FLOAT(7, 4);
    DECLARE c, nextn, cand_t INTEGER;
    DECLARE estatus CHAR(1);
    DECLARE the_name VARCHAR(64);
    DECLARE cand_id VARCHAR(64);
    DECLARE end_of_loop, cand_exists, edgeA_exists, edgeB_exists SMALLINT DEFAULT 0;
    DECLARE scratchPeople CURSOR FOR
      SELECT DISTINCT id
      FROM scratch
      WHERE graph = graph_id AND id <> startc;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_loop = 1;

    CALL llog(graph_id, startc, startc, 'EXPAND_LNODE: START');

    SET drop_threshold = CAST(get_par('rl.drop_threshold') AS DECIMAL);
    /* get a block of candidates for expansion.*/

    CALL make_block(graph_id, startc, CAST(get_par('rl.block_size') AS UNSIGNED INTEGER));
    /* collect candidates */


    SELECT count(DISTINCT id)
    INTO c
    FROM scratch
    WHERE graph = graph_id;
    CALL llog(graph_id, startc, startc, concat('EXPAND_LNODE: SCRATCH TABLE CONTAINS ', c, ' OCCURENCES'));
    SELECT max(n) + 1
    INTO nextn
    FROM candidates
    WHERE graph = graph_id;
    CALL llog(graph_id, startc, startc, concat('EXPAND_LNODE: NEXT CANDIDATE NUMBER ', c));
    OPEN scratchPeople;
    FETCH scratchPeople
    INTO cand_id;

    WHILE (end_of_loop = 0) DO
      SET cand_exists := 0;
      SET edgeA_exists := 0;
      SET edgeB_exists := 0;
      SET cand_t := 0;

      /* do we have this candidate in the graph  */

      SELECT count(*)
      INTO c
      FROM candidates
      WHERE instance = cand_id AND graph = graph_id;
      IF c > 0
      THEN
        SET cand_exists = 1;
        CALL llog(graph_id, startc, cand_id, 'EXPAND_LNODE: CANDIDATE EXISTS');
      /*
      -- if candidate exists check if it was not flagged by gtest rules
      -- I don't think this is being used because no one is calling gtest rules during this.
      --SELECT count(*) INTO cand_t FROM candidates
      --			WHERE instance=cand_id AND graph=graph_id AND status='T';
      */

      END IF;

      IF cand_t = 0
      THEN /* if this candidate was not flagged by gtest */

        /* Do we have the inverse edge  */

        SELECT count(*)
        INTO c
        FROM ledges
        WHERE instanceA = cand_id AND instanceB = startc AND graph = graph_id;
        IF c > 0
        THEN
          SET edgeA_exists := 1;
          CALL llog(graph_id, startc, cand_id, 'EXPAND_LNODE: INVERSE EDGE EXISTS');
        END IF;

        /* Do we have this very edge  */

        SELECT count(*)
        INTO c
        FROM ledges
        WHERE instanceB = cand_id AND instanceA = startc AND graph = graph_id;
        IF c > 0
        THEN
          SET edgeB_exists := 1;
          CALL llog(graph_id, startc, cand_id, 'EXPAND_LNODE: EDGE EXISTS');
        END IF;

        IF edgeA_exists + edgeB_exists = 0
        THEN
          /* no memory of this match, and not a T candidate -> must compare */

          CALL cmp_person(startc, cand_id, score);
        ELSE
          /*  some edge exists so we fetch the score */

          IF edgeA_exists = 1
          THEN
            SELECT ledges.bweight
            INTO score
            FROM ledges
            WHERE instanceA = cand_id AND instanceB = startc AND graph = graph_id;
          END IF;
          IF edgeB_exists = 1
          THEN
            SELECT ledges.bweight
            INTO score
            FROM ledges
            WHERE instanceB = cand_id AND instanceA = startc AND graph = graph_id;
          END IF;
        END IF;

        IF score > threshold
        THEN
          IF cand_exists = 0
          THEN
            VALUES (graph_id, cand_id, 'N', 0, nextn);
            SET nextn = nextn + 1;
            CALL llog(graph_id, startc, cand_id, 'EXPAND_LNODE: NEW CANDIDATE');
          END IF;
          IF edgeA_exists = 0
          THEN
            VALUES (graph_id, cand_id, startc, score, 'G');
          END IF;
          IF edgeB_exists = 0
          THEN
            VALUES (graph_id, startc, cand_id, score, 'G');
          END IF;

        END IF;
        /* score above threshold */

        CALL llog(graph_id, startc, cand_id, concat('EXPAND_LNODE: TEST=', CAST(score AS CHAR), '/', threshold));
        COMMIT;
      ELSE /* cand_t=0    */

        CALL llog(graph_id, startc, cand_id, concat('EXPAND_LNODE: SKIPPED "T" candidate'));
      END IF;
      FETCH scratchPeople
      INTO cand_id;
    END WHILE;
    COMMIT;
    UPDATE candidates
    SET status = 'V'
    WHERE
      instance = startc AND graph = graph_id;
    COMMIT;
    CALL llog(graph_id, startc, startc, 'EXPAND_LNODE: STOP');
    CALL set_par('dbSystem.error_procedure', 'expand_lnode EXIT OK');
  END ;;
DELIMITER ;
