CREATE DEFINER=`root`@`%` PROCEDURE `fill_graph`(graph_id VARCHAR(64),
                 threshold FLOAT(7,4))
BEGIN
		DECLARE score  FLOAT(7,4);
		DECLARE c INTEGER;
		DECLARE end_of_cursor SMALLINT default 0;
		DECLARE insta,instb VARCHAR(64);
		DECLARE missingEdges CURSOR FOR
			SELECT a.instance insta,b.instance instb
			       FROM candidates a, candidates b 
			       WHERE a.graph=graph_id AND b.graph=graph_id 
			             AND a.instance<>b.instance 
			             AND NOT exists 
			                (SELECT * FROM ledges 
			                   WHERE instanceA=a.instance 
			                         AND instanceB=b.instance AND graph=graph_id);
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

		CALL llog(graph_id,graph_id,threshold,'FILL_GRAPH: START');
		COMMIT;
		OPEN missingEdges;
		FETCH missingEdges INTO insta,instb;
		WHILE (end_of_cursor=0) DO
			CALL cmp_person(insta,instb,score);
	        CALL llog(graph_id,insta,instb,concat('FILL_GRAPH: TEST=',score));
	     	IF score > threshold THEN 	 
	          		VALUES (graph_id,insta,instb,score,'G');
        		COMMIT;
	    		CALL llog(graph_id,insta,instb,'FILL_GRAPH: NEW EDGE (G)');
      		ELSEIF score>cast(get_par('rl.drop_threshold') as DECIMAL) THEN
	          		VALUES (graph_id,insta,instb,score,'L');
        		COMMIT;
	       		CALL llog(graph_id,instb,insta,'FILL_GRAPH: NEW EDGE (L)');
	  		END IF;
			COMMIT;
			FETCH missingEdges INTO  insta,instb;
		END WHILE;
		CALL llog(graph_id,graph_id,threshold,'FILL_GRAPH: STOP');
	END ;;
DELIMITER ;
