CREATE DEFINER=`root`@`%` PROCEDURE `get_value_info`(IN  the_attribute VARCHAR(32),
                                IN  the_value     VARCHAR(254),
                                OUT the_nvalue    VARCHAR(254),
                                OUT the_npersons  INTEGER(6),
                                OUT the_normcoef  FLOAT(5, 4),
                                OUT the_rfreq     FLOAT(7, 6),
                                OUT the_date      DATETIME)
BEGIN
    DECLARE EXIT HANDLER FOR NOT FOUND
    BEGIN
      CALL update_value_info(the_attribute, the_value, now());
      SELECT
        nvalue,
        normcoef,
        npersons,
        rfreq,
        lastupdate
      INTO the_nvalue, the_normcoef, the_npersons, the_rfreq, the_date
      FROM value_info
      WHERE attribute = the_attribute AND value = the_value;
    END;

    SELECT
      nvalue,
      normcoef,
      npersons,
      rfreq,
      lastupdate
    INTO the_nvalue, the_normcoef, the_npersons, the_rfreq, the_date
    FROM value_info
    WHERE attribute = the_attribute AND value = the_value;
  END ;;
