CREATE DEFINER=`root`@`%` PROCEDURE `gtest_bapt1`(G VARCHAR(64))
BEGIN
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE m1_ida, m1_idb VARCHAR(64);
    DECLARE birth_act_function VARCHAR(500);

    DECLARE m1 CURSOR FOR
      SELECT DISTINCT
        ra.origin,
        rb.origin
      FROM relations ra, relations rb, candidates ca, candidates cb, acts aa, acts ab
      WHERE
        ca.graph = G
        AND cb.graph = G
        AND ra.origin = ca.instance
        AND rb.origin = cb.instance
        AND ra.the_type = 'function-in-act'
        AND rb.the_type = 'function-in-act'
        AND ra.destination = aa.id
        AND rb.destination = ab.id
        AND ca.instance > cb.instance -- this is to avoid testing twice the same pair
        AND FIND_IN_SET(concat(aa.the_type, '-', ra.the_value), birth_act_function)
        AND FIND_IN_SET(concat(ab.the_type, '-', rb.the_value), birth_act_function);
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SET birth_act_function = get_par('rl.functions.birth');

    OPEN m1;
    FETCH m1
    INTO m1_ida, m1_idb;
    WHILE (end_of_cursor = 0) DO
      CALL syslog(5, concat('gtest_bapt1', '(', G, ')'),
                  concat('marking edge as impossible:', m1_ida, '-', m1_idb));
      CALL mark_edge(G, m1_ida, m1_idb, 'T');
      CALL llog(G, m1_ida, m1_idb, 'GTEST_BAPT1 ONLY ONE BAPTISM');
      FETCH m1
      INTO m1_ida, m1_idb;
    END WHILE;
    CLOSE m1;
  END ;;
DELIMITER ;
