CREATE DEFINER=`root`@`%` PROCEDURE `gtest_burials1`(G VARCHAR(64))
BEGIN
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE m_instance, s_instance VARCHAR(64);
    DECLARE m_date, s_rdate VARCHAR(24);
    DECLARE s_the_type VARCHAR(254);
    DECLARE s_the_value VARCHAR(254);
    DECLARE must_be_alive VARCHAR(2048);
    DECLARE deceased VARCHAR(500);

    DECLARE m CURSOR FOR
      SELECT
        instance,
        the_date
      FROM candidates C, attributes A
      WHERE
        C.GRAPH = G
        AND entity = instance
        AND FIND_IN_SET(concat(the_type, '-', the_value), deceased) > 0;
    DECLARE s CURSOR FOR
      SELECT
        instance,
        r.the_date,
        the_value,
        a.the_type
      FROM candidates c, relations r, acts a
      WHERE c.graph = G AND origin = instance AND destination = a.id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SELECT
      get_par('rl.functions.must.be.alive'),
      get_par('rl.attributes.deceased')
    INTO must_be_alive, deceased;

    OPEN m;
    FETCH m
    INTO m_instance, m_date;
    WHILE (end_of_cursor = 0) DO
      CALL syslog(5, concat('gtest_burials1', '(', G, ')'),
                  concat('using that ', m_instance, ' was dead in ', m_date));
      OPEN s;
      FETCH s
      INTO s_instance, s_rdate, s_the_value, s_the_type;
      WHILE (end_of_cursor = 0) DO
        IF s_rdate > m_date
        THEN
          IF FIND_IN_SET(concat(s_the_type, '-', s_the_value), must_be_alive) > 0
          THEN
            CALL syslog(5, concat('gtest_burials1', '(', G, ')'),
                        concat('marking edge as impossible:', m_instance, '->', s_instance));
            CALL llog(G, m_instance, s_instance, 'GTEST_BURIALS1 CANNOT APPEAR WITH rl.functions.must.be.alive');
            CALL mark_edge(G, m_instance, s_instance, 'T');
          END IF;
        END IF;
        FETCH s
        INTO s_instance, s_rdate, s_the_value, s_the_type;
      END WHILE;
      CLOSE s;
      SET end_of_cursor = 0;
      FETCH m
      INTO m_instance, m_date;
    END WHILE;
    CLOSE m;
  END ;;
DELIMITER ;
