CREATE DEFINER=`root`@`%` PROCEDURE `gtest_burials2`(G VARCHAR(64))
BEGIN
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE deceased, s_instance VARCHAR(64);
    DECLARE death_date VARCHAR(24);
    DECLARE burial_act_function VARCHAR(500);
    DECLARE s_rdate VARCHAR(24);
    DECLARE s_the_type VARCHAR(254);
    DECLARE s_the_value VARCHAR(254);
    DECLARE must_be_alive VARCHAR(2048);
    DECLARE must_be_death_recently VARCHAR(2048);
    DECLARE log_origin VARCHAR(128);
    DECLARE m1 CURSOR FOR
      SELECT
        origin,
        acts.the_date
      FROM relations, candidates, acts
      WHERE
        candidates.graph = G
        AND candidates.instance = relations.origin
        AND relations.destination = acts.id
        AND FIND_IN_SET(concat(acts.the_type, '-', relations.the_value), burial_act_function);
    DECLARE s CURSOR FOR
      SELECT
        instance,
        r.the_date,
        the_value,
        a.the_type
      FROM candidates c, relations r, acts a
      WHERE c.graph = G AND origin = instance AND destination = a.id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SET burial_act_function = get_par('rl.functions.deceased');
    SET must_be_alive = get_par('rl.functions.must.be.alive');
    SET must_be_death_recently = get_par('rl.functions.must.be.death.less.than.days.180');
    /*
    This could be generalized to various periods and functions by looping the parameters
    SELECT substring(pname FROM length('rl.functions.must.be.death.less.than.days.')+1),
         pvalue
    FROM syspar
    WHERE pname LIKE 'rl.functions.must.be.death.less.than.days.%' and pname not like '%.doc'

    */

    SET log_origin = concat('gtest_burials2', '(', G, ')');
    CALL syslog(5, log_origin,
                concat('burial_act_function:', burial_act_function));
    CALL syslog(5, log_origin,
                concat('must_be_alive: ', must_be_alive));
    OPEN m1;
    FETCH m1
    INTO deceased, death_date;
    WHILE (end_of_cursor = 0) DO
      CALL syslog(5, log_origin,
                  concat('marking as impossible acts later than:', death_date, ' for ', deceased));
      OPEN s;
      FETCH s
      INTO s_instance, s_rdate, s_the_value, s_the_type;
      WHILE (end_of_cursor = 0) DO
        IF s_rdate > death_date
        THEN
          CALL syslog(5, log_origin,
                      concat('testing:', s_rdate, '>', death_date, ' in ', concat(s_the_type, '-', s_the_value)));
          IF FIND_IN_SET(concat(s_the_type, '-', s_the_value), must_be_alive) > 0
          THEN
            CALL syslog(5, log_origin,
                        concat('marking edge as impossible:', deceased, '->', s_instance));
            CALL mark_edge(G, deceased, s_instance, 'T');
            CALL llog(G, deceased, s_instance, 'GTEST_BURIALS2 CANNOT APPEAR WITH rl.functions.must.be.alive');

          END IF;
        END IF;
        IF FIND_IN_SET(concat(s_the_type, '-', s_the_value), must_be_death_recently)
        THEN
          CALL syslog(5, log_origin,
                      concat('testing:', s_rdate, '-', death_date, ' > 180 in ', concat(s_the_type, '-', s_the_value)));
          IF mhk_date_diff(death_date, s_rdate) > 180
          THEN
            CALL syslog(5, log_origin,
                        concat('marking edge as impossible death too long ago:', deceased, '->', s_instance));
            CALL mark_edge(G, deceased, s_instance, 'T');
            CALL llog(G, deceased, s_instance,
                      'GTEST_BURIALS2 CANNOT APPEAR WITH rl.functions.must.be.death.less.than.days.180');
          END IF;
        END IF;
        FETCH s
        INTO s_instance, s_rdate, s_the_value, s_the_type;
      END WHILE;
      CLOSE s;
      SET end_of_cursor = 0;
      FETCH m1
      INTO deceased, death_date;
    END WHILE;
    CLOSE m1;
  END ;;
DELIMITER ;
