CREATE DEFINER=`root`@`%` PROCEDURE `gtest_selfrel`(G VARCHAR(64))
BEGIN
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE e_A, e_B VARCHAR(64);
    DECLARE selfrel CURSOR FOR
      SELECT
        c1.instance A,
        c2.instance B
      FROM candidates c1, candidates c2, relations R
      WHERE
        c1.graph = G
        AND c2.graph = G
        AND c1.instance = origin
        AND c2.instance = destination
        AND R.the_type <> 'Identification'
        AND R.the_value <> 'same as';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    OPEN selfrel;
    FETCH selfrel
    INTO e_A, e_B;
    WHILE (end_of_cursor = 0) DO
      CALL syslog(5, concat('gtest_selfrel', '(', G, ')'), concat('marking edge as impossible:', e_A, '->', e_B));
      CALL llog(G, e_A, e_B, 'GTEST_SELFREL CANNOT HAVE RELATIONS WITH SELF');
      CALL mark_edge(G, e_A, e_B, 'T');
      FETCH selfrel
      INTO e_A, e_B;
    END WHILE;
    CLOSE selfrel;
  END ;;
