CREATE DEFINER=`root`@`%` PROCEDURE `insert_frequent`(graph_id VARCHAR(64), startc VARCHAR(64), no_more_than INTEGER)
BEGIN
    DECLARE pname VARCHAR(254);
    DECLARE rl_overlap VARCHAR(6);
    DECLARE rl_ignore_for_match VARCHAR(1024);
    DECLARE the_name VARCHAR(64);
    DECLARE nc, nc1, nc2, nc3 INTEGER;
    DECLARE rb BOOLEAN;
    DECLARE a_type VARCHAR(32);
    DECLARE a_nvalue VARCHAR(254);
    DECLARE a_npersons INTEGER;
    DECLARE timer1, timer2, lapsed1, lapsed2, lapsed3 TIMESTAMP;
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE usableAttributes CURSOR FOR -- this cursor gets the attributes comparable
      SELECT DISTINCT
        a.the_type,
        n.nvalue,
        n.npersons
      FROM attributes a, attribute_info ai, value_info v, nvalue_info n
      WHERE
        a.entity = startc
        AND a.the_type = v.attribute AND a.the_value = v.value
        AND v.attribute = n.attribute AND v.nvalue = n.nvalue
        AND a.the_type = ai.id
        AND ai.ndescrim > CAST(get_par('rl.ndescrim.generation.threshold') AS SIGNED INTEGER)
        AND FIND_IN_SET(a.the_type, get_par('rl.attributes.ignored.for.generation')) = 0
      ORDER BY n.npersons;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    CALL llog(graph_id, startc, startc, 'MAKE_BLOCK: INSERT FREQUENT START');

    SET rl_overlap = get_par('rl.overlap');
    SET rl_ignore_for_match = get_par('rl.values.ignored.for.match');

    -- We fetch the name and the first name of the person for selection
    SELECT min(the_value)
    INTO pname
    FROM attributes
    WHERE entity = startc AND the_type = '*first_name';
    SELECT name
    INTO the_name
    FROM persons
    WHERE id = startc;

    CALL llog(graph_id, startc, startc, concat('MAKE_BLOCK: NAME=', the_name));

    OPEN usableAttributes;
    FETCH usableAttributes
    INTO a_type, a_nvalue, a_npersons;
    WHILE (end_of_cursor = 0) DO -- For each of the attributes to be used for generation
      CALL llog(graph_id, startc, startc,
                concat('MAKE_BLOCK: SEARCHING: ', a_type, '/', a_nvalue, ' (npersons=', a_npersons,
                       ') WITH FIRST NAME   ', pname));
      COMMIT
      -- IDEA PARA EVITAR PESQUISAS INUTEIS, VER MAIS COMENTARIOS ABAIXO.
      -- SELECT count(*) into c from avoid_this where graph=graph_id AND attribute=a_type AND value=a_nvalue AND mode='pname'
      -- IF c > 0 THEN *** NO POINT DOING THIS
    ;
      -- IMPORTANT NO LOGGIN FROM THIS POINT, TO AVOID IMPLICIT COMMITS

      START TRANSACTION;
      SELECT count(DISTINCT id)
      INTO nc1
      FROM scratch
      WHERE graph = graph_id;

      SET timer1 = SYSDATE();
        SELECT DISTINCT
          entity,
          graph_id
        FROM attributes a,
          value_info v, persons p
        WHERE
          a.the_type = a_type
          AND v.attribute = a_type
          AND v.nvalue = a_nvalue
          AND a.the_value = v.value
          AND a.entity = p.id
          AND p.name LIKE concat(pname, '%');

      IF rl_overlap
      THEN
        CALL remove_linked(graph_id);
      END IF;

      -- we now check if we have gone over limit. If so we roll back
      SELECT count(DISTINCT id)
      INTO nc
      FROM scratch
      WHERE graph = graph_id;
      IF nc > no_more_than
      THEN
        ROLLBACK;
        SET rb := 1;
      ELSE
        COMMIT;
        SET rb := 0;
      END IF;
      -- END OF LOG FREE ZONE

      SELECT count(DISTINCT id)
      INTO nc2
      FROM scratch
      WHERE graph = graph_id;

      SET timer2 = SYSDATE();

      SET lapsed1 = TIMEDIFF(timer2, timer1);

      CALL llog(graph_id, startc, startc,
                concat('MAKE_BLOCK: SCRATCH SIZE: START:', nc1, ' AFTER SEARCH: ', nc, ' AFTER SIZE CHECK: ', nc2,
                       ' TIME ', DATE_FORMAT(lapsed1, '%k:%i:%s.%f')));

      -- AQUI PODIAMOS GUARDAR  ESTE ATRIBUTO VALOR PARA NAO TORNARMOS A TENTATR NESTE GRAFO.

      IF rb
      THEN -- tentamos de novo com o nome completo
        CALL llog(graph_id, startc, startc,
                  concat('MAKE_BLOCK: RETRYING: ', a_type, '/', a_nvalue, ' with complete name ', the_name));
        -- AQUI POD�AMOS GUARDAR  ESTE ATRIBUTO VALOR PARA NAO TORNARMOS A TENTATR NESTE GRAFO.
        -- INSERT INTO avoid_this (graph,attribute,value,mode) values (graph_id,a_type,a_nvalue,'pname');

        -- SELECT count(*) into c from avoid_this where graph=graph_id AND attribute=a_type AND value=a_nvalue AND mode='fullname'
        -- IF c > 0 THEN *** NO POINT DOING THIS

        START TRANSACTION;
        -- LOG FREE ZONE TO AVOID IMPLICIT COMMIT
        SELECT count(DISTINCT id)
        INTO nc1
        FROM scratch
        WHERE graph = graph_id;
        SET timer1 = SYSDATE();
          SELECT DISTINCT
            entity,
            graph_id
          FROM
            attributes a,
            value_info v,
            persons p
          WHERE

            v.attribute = a_type AND v.nvalue = a_nvalue AND
            a.the_type = a_type AND a.the_value = v.value AND
            a.entity = p.id
            AND
            p.name = the_name;
        SET timer2 = SYSDATE();
        SET lapsed1 = TIMEDIFF(timer2, timer1);
        IF rl_overlap = 'N'
        THEN
          CALL remove_linked(graph_id);
        END IF;

        SELECT count(DISTINCT id)
        INTO nc
        FROM scratch
        WHERE graph = graph_id;
        IF nc > no_more_than
        THEN
          SET timer1 = SYSDATE();
          ROLLBACK;
          SET timer2 = SYSDATE();
          SET lapsed2 = TIMEDIFF(timer2, timer1);
          SET rb := 1;
        -- INSERT INTO avoid_this (graph,attribute,value,mode) values (graph_id,a_type,a_nvalue,'fullname');

        ELSE
          COMMIT;
          SET rb := 0;
        END IF;

        -- END OF LOG FREE ZONE
        SELECT count(DISTINCT id)
        INTO nc2
        FROM scratch
        WHERE graph = graph_id;
        CALL llog(graph_id, startc, startc,
                  concat('MAKE_BLOCK: SCRATCH SIZE: START:', nc1, ' AFTER SEARCH: ', nc, ' AFTER SIZE CHECK: ', nc2,
                         ' TIME ', DATE_FORMAT(lapsed1, '%k:%i:%s.%f')));

      END IF;
      FETCH usableAttributes
      INTO a_type, a_nvalue, a_npersons;

    END WHILE;
    CLOSE usableAttributes;
    CALL llog(graph_id, startc, startc, 'MAKE_BLOCK: INSERT FREQUENT STOP');
  END ;;
DELIMITER ;
