CREATE DEFINER=`root`@`%` PROCEDURE `insert_geo_auto_values`()
BEGIN
    CALL insert_log(1, 'insert_geo_auto_values', 'currently disabled because of performnce issues...');
    IF FALSE THEN
    -- IGNORE ignores duplicate inserts

    -- This generates an entity class geoentity for each act with loc with id=$actID-geo
    -- these entities are inside the act
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for acts with loc (1)');
    SELECT CONCAT(id, '-geo') AS id,
           'geoentity'        AS class,
           id                 AS inside,
           '*geoentity'       AS groupname
    FROM acts
    WHERE loc != '';
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for acts with loc (2)');
                                           'act_loc'          AS the_type,
                                           loc                AS name,
                                           obs
                                    FROM acts
                                    WHERE loc != '');

    -- this inserts a relation with origin in one the geoentities inserted above and destination actid
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for acts with loc (3)');
    SELECT CONCAT(id,
                  '-geo-rel')    AS id,
           CONCAT(id,
                  '-geo')        AS origin,
           id                    AS destination,
           the_date,
           'geografica'          AS the_type,
           'act_loc'             AS the_value,
           '*automatic relation' AS obs
    FROM acts
    WHERE loc != '';

    -- this inserts into entities the relations above
    -- these relations are inside the act
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for acts with loc (4)');
    SELECT CONCAT(id, '-geo-rel') AS id,
           'relation'             AS class,
           id                     AS inside,
           '*georelation'         AS groupname
    FROM acts
    WHERE loc != '';

    -- this creates a geoentity for each attribute  where the the type is like '%loc%' with id=AttributeID-geo
    -- first creates the entities inside the enclosing entity of the attribute
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for atributes like loc (1)');
    SELECT CONCAT(attributes.id, '-geo') AS id,
           'geoentity'                   AS class,
           entities.inside,
           '*geoentity'                  AS groupname
    FROM entities,
         attributes
    WHERE entities.id = attributes.entity
        AND the_type LIKE '%residencia%'
       OR the_type LIKE '%naturalidade%'
       OR the_type LIKE '%loc%';
    -- then the geoentities
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for atributes like loc (2)');
    SELECT CONCAT(id, '-geo') AS id,
           the_type,
           the_value          AS name,
           obs
    FROM attributes
    WHERE the_type LIKE '%residencia%'
       OR the_type LIKE '%naturalidade%'
       OR the_type LIKE '%loc%';

    -- this generates a relation between a geoentity with id=AttributeID-geo and the entitiy enclosing of the attribute
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for atributes like loc (3)');
                                         CONCAT(id, '-geo')     AS origin,
                                         entity                 AS destination,
                                         the_date,
                                         'geografica'           AS the_type,
                                         the_type               AS the_value,
                                         '*automatic relation'  AS obs
                                  FROM attributes
                                  WHERE the_type LIKE '%residencia%'
                                     OR the_type LIKE '%naturalidade%'
                                     OR the_type LIKE '%loc%');

    -- the generates the entity of class relation for the relations above inside the geoentity above
    CALL insert_log(2, 'insert_geo_auto_values', 'generating geo entities for atributes like loc (4)');
    SELECT CONCAT(id, '-geo-rel') AS id,
           'relation'             AS class,
           CONCAT(id, '-geo')     AS inside,
           '*georelation'         AS groupname
    FROM attributes
    WHERE the_type LIKE '%residencia%'
       OR the_type LIKE '%naturalidade%'
       OR the_type LIKE '%loc%';

    COMMIT;
    END IF;
    CALL insert_log(1, 'insert_geo_auto_values', 'skipped.');
END ;;
DELIMITER ;
