CREATE DEFINER=`root`@`%` PROCEDURE `insert_in_cache`(pid VARCHAR(64))
mainBlock:
  BEGIN
    DECLARE count1 INTEGER;
    DECLARE count2 INTEGER;
    DECLARE the_date TIMESTAMP;
    DECLARE a_type VARCHAR(32);
    DECLARE a_value VARCHAR(254);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE attributesToInsert CURSOR FOR
      SELECT
        the_type,
        the_value
      FROM attributes atr
      WHERE entity = pid
            AND NOT EXISTS
      (SELECT *
       FROM cache
       WHERE person = pid AND attribute = atr.the_type
             AND value = atr.the_value)
      ORDER BY the_type, the_value;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SET @@max_sp_recursion_depth = 2;
    CALL syslog(4, concat('insert_in_cache(', pid, ')'), 'START');

    SELECT count(*)
    INTO count2
    FROM cache
    WHERE person = pid;

    IF count2 > 0
    THEN
      CALL syslog(4, concat('insert_in_cache(', pid, ')'), 'STOP already there - leaving');
      LEAVE mainBlock;
    END IF;

    CALL syslog(5, concat('insert_in_cache(', pid, ')'), 'Inserting in cache with select');

    /* this insert into the cache table an extende copy on the attribute table for a given entity:
      it includes the attribute type, value and date, like in the normal attributes case, but adds
      the normalized value, the relative frequency of the normalized value, the pnotlink probability of the value
      and of the attribute. These variables are necessary to compute the binit weigth. By storing them in a temporary table we
      avoid fetching the statistics repeateadely while comparing a person to possible candidates for record linking.
      */

      SELECT
        a.id,
        a.entity,
        a.the_type,
        a.the_value,
        a.the_date,
        v.nvalue,
        n.rfreq,
        n.pnotlink,
        n.pnlcases,
        av.npnotlink
      FROM
        attributes a, value_info v, nvalue_info n, attribute_info av

      WHERE
        a.entity = pid
        AND a.the_type = v.attribute
        AND a.the_value = v.value
        AND a.the_type = n.attribute
        AND v.nvalue = n.nvalue
        AND a.the_type = av.id;

    COMMIT WORK;

    -- TODO non relevant value should come from a table select the_value from ignore_values
    SELECT count(*)
    INTO count1
    FROM attributes
    WHERE entity = pid AND the_value NOT IN ('?', 'nome', 'desconhecido');
    SELECT count(*)
    INTO count2
    FROM cache
    WHERE person = pid;

    /* We test if all the attributes of person pid made it to the cache. If not it  means that there missing
       entries in the attribute info table or the nvalue info. So we update dynamically those tables and
       associated statistics.
   */

    IF count1 > count2
    THEN

      CALL syslog(5, concat('insert_in_cache(', pid, ')'),
                  'Missing statistics detected. Probably recently updated data.');

      OPEN attributesToInsert;
      FETCH attributesToInsert
      INTO a_type, a_value;

      WHILE (end_of_cursor = 0) DO
        CALL set_nvalue(a_type, a_value, a_value, 1);
        CALL syslog(5, concat('insert_in_cache(', pid, ')'),
                    concat('updating missing stats for ', a_type, "/", a_value));
        SELECT NOW()
        INTO the_date;
        CALL update_attribute_info(a_type, the_date);
        CALL update_value_info(a_type, a_value, the_date);
        CALL update_nvalue_info(a_type, a_value, the_date);
        CALL update_nvalue_link_info(a_type, a_value, the_date);
        FETCH attributesToInsert
        INTO a_type, a_value;
      END WHILE;
      COMMIT;
      CLOSE attributesToInsert;
      /* chamamo-nos de novo TODO this never works because of the LEAVE test above */

      CALL syslog(5, concat('insert_in_cache(', pid, ')'), 'Recursing after updating statistics.');
      DELETE FROM cache
      WHERE person = pid;
      COMMIT;
      CALL insert_in_cache(pid);
    END IF;
    CALL syslog(4, concat('insert_in_cache(', pid, ')'), 'STOP');
  END ;;
