CREATE DEFINER=`root`@`%` PROCEDURE `last_modified_code`(n INT)
BEGIN
    SELECT
      routine_schema,
      routine_name,
      last_altered
    FROM information_schema.routines
    WHERE last_altered > (now() - INTERVAL n MINUTE)
    ORDER BY last_altered DESC;
