CREATE DEFINER=`root`@`%` PROCEDURE `lgraph_to_rpersons`(graph_id VARCHAR(64), vuser VARCHAR(64))
BEGIN
	DECLARE end_of_cursor SMALLINT DEFAULT 0;
	DECLARE acluster SMALLINT;
	DECLARE tmp VARCHAR(64);
	DECLARE c CURSOR FOR select distinct clust from candidates where graph=graph_id;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;	
	
	CALL llog(graph_id,graph_id,vuser,'GRAPH_TO_RPERSONS: START');
	OPEN c;
	SET end_of_cursor:=0;
	FETCH c into acluster;
	WHILE (end_of_cursor=0) DO
		call cluster_to_rperson(graph_id,acluster,vuser,tmp);
		FETCH c into acluster;
	END WHILE;
	CALL llog(graph_id,graph_id,vuser,'GRAPH_TO_RPERSONS: STOP');
END ;;
