CREATE DEFINER=`root`@`%` PROCEDURE `LinkingDictionaryFix`()
BEGIN

    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE vid VARCHAR(64);
    DECLARE vname VARCHAR(64);
    DECLARE vsex CHAR(1);
    DECLARE vobs TEXT;
    DECLARE bad_instances CURSOR FOR select DISTINCT instance from links where instance not in (select id from persons);
    DECLARE empty_rpersons CURSOR FOR select id from rpersons where id not in (select distinct rid from links);
    DECLARE empty_robjects CURSOR FOR select id from robjects where id not in (select distinct rid from links);
    DECLARE empty_rentities CURSOR FOR select id from rentities where id not in (select distinct rid from links);

    DECLARE no_entity_rpersons CURSOR FOR select distinct id from rpersons where rpersons.id not in (select entities.id from entities);

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;
    CALL insert_log(1, 'LinkingDictionaryFix', 'Linking Dictionary Check and Repair started');
    OPEN bad_instances;
    REPEAT
        FETCH bad_instances INTO vid;
        CALL insert_log( 5, 'LinkingDictionaryFix', concat('bad instance: ',vid));
        DELETE FROM links where instance=vid;
    UNTIL end_of_cursor=1 END REPEAT;
    COMMIT;
    CLOSE bad_instances;

    OPEN empty_rpersons;
    SET end_of_cursor=0;
    REPEAT
       FETCH empty_rpersons INTO vid;
       IF (vid IS NOT NULL) THEN
        CALL insert_log( 0, 'LinkingDictionaryFix', concat('empty rperson: ' ,vid));
        DELETE from rpersons WHERE id=vid;
        DELETE FROM rentities WHERE id=vid;
        DELETE FROM entities WHERE id=vid;
        commit;
        END IF;
    UNTIL end_of_cursor=1 END REPEAT;
    CLOSE empty_rpersons;

    OPEN empty_robjects;
    SET end_of_cursor=0;
    REPEAT
       FETCH empty_robjects INTO vid;
       IF (vid IS NOT NULL) THEN
        CALL insert_log( 0, 'LinkingDictionaryFix', concat('empty robject: ' ,vid));
        DELETE from robjects WHERE id=vid;
        DELETE FROM rentities WHERE id=vid;
        DELETE FROM entities WHERE id=vid;
        commit;
        END IF;
    UNTIL end_of_cursor=1 END REPEAT;
    CLOSE empty_robjects;

    OPEN empty_rentities;
    SET end_of_cursor=0;
    REPEAT
       FETCH empty_rentities INTO vid;
       IF (vid IS NOT NULL) THEN
        CALL insert_log( 0, 'LinkingDictionaryFix', concat('empty rentity: ' ,vid));
        DELETE FROM rentities WHERE id=vid;
        DELETE FROM entities WHERE id=vid;
        commit;
        END IF;
    UNTIL end_of_cursor=1 END REPEAT;
    CLOSE empty_rentities;

    OPEN no_entity_rpersons;
    SET end_of_cursor=0;
    CALL insert_log( 0, 'LinkingDictionaryFix', 'Checking for rpersons with no entity associated');
    REPEAT
       FETCH no_entity_rpersons INTO vid;
        CALL insert_log( 0, 'LinkingDictionaryFix', concat('found a rperson without entity: ' ,vid));
        IF (vid IS NOT NULL) THEN
          CALL insert_log( 0, 'LinkingDictionaryFix', concat('no entity rperson: ' ,vid));
        END IF;
        CALL insert_log( 0, 'LinkingDictionaryFix', 'looping');

    UNTIL end_of_cursor=1 END REPEAT;
    COMMIT;
    CLOSE no_entity_rpersons;

    CALL insert_log(1, 'LinkingDictionaryFix', 'Linking Dictionary Check and Repair Finished');
  END ;;
DELIMITER ;
