CREATE DEFINER=`root`@`%` PROCEDURE `linking_params_init`()
BEGIN
    -- Record linking, general control
    CALL set_par_obs('rl.linklog', 'YES', 'set to YES to make linking log active');
    CALL set_par_obs('rl.queue', 'YES', 'set to STOP to put record linking on hold');
    CALL set_par_obs('rl.language', 'PT',
                     'language of the data: used for stop words and other normalization processes');
    CALL set_par_obs('rl.graph.factor', 2,
                     'when evaluating links this determines the weight of the graph factor over the value of the edge.');
    CALL set_par_obs('rl.high_threshold', 12, 'only accept candidates if cmp_persons >= high_threshold');
    CALL set_par_obs('rl.drop_threshold', 3, 'if cmp_persons lower than this then ignore absolutely');
    CALL set_par_obs('rl.block_size', 400, 'maximum persons considered for linking at each generation step');
    CALL set_par_obs('rl.overlap', 'Y',
                     'use in the generation phase ids already linked, If different of \'Y\' occurrences already linked are not used.');
    CALL set_par_obs('rl.ndescrim.generation.threshold', 1,
                     'do not use attributes in generation step with ndescrim bellow this');
    CALL set_par_obs('rl.attributes.ignored.for.generation', 'idade_aprox,idade,ec,morto,morta',
                     ' these attributes are not relevant when looking for people with similar attributes');
    CALL set_par_obs('rl.values.ignored.for.match', 'nome,?,desconhecido,desconhecida,agora,antes',
                     'these values are not relevant when comparing different people');
    CALL set_par_obs('rl.attributes.ignored.for.match', 'idade_aprox,ec,residiu,idade,morto,morta',
                     ' attributes ignored in generation phase');
    CALL set_par_obs('rl.functions.must.be.alive',
                     'b-pad,b-mad,b-n,cas-noivo,cas-noiva,cas-test,escritura-procurador,escritura-comprador,escritura-aforador,devassa-acusado,devassa-acusada,o-n,obito-n',
                     'when people appear in acts with this functionsthey must be alive. Syntax actType-Function e.g. b-n, cas-noivo. (used in soving ambiguities in record linking');
    CALL set_par_obs('rl.attributes.deceased', 'morto-agora,morto-antes,morta-agora,morta-antes',
                     'these attribute-value pairs imply that the person is dead at the date of the attrbiute or before');
    CALL set_par_obs('rl.functions.deceased', 'o-n,obito-n',
                     'these functions in acts imply that the actor is dead at the date of the act');
    CALL set_par_obs('rl.functions.birth', 'b-n,bap-n', 'these acts adn functions imply birth');
    CALL syslog(0, 'linking_params_init', 'DONE.');
  END ;;
DELIMITER ;
