CREATE DEFINER=`root`@`%` PROCEDURE `link_next`()
BEGIN
    DECLARE vid VARCHAR(64);
    DECLARE vp INTEGER;
    DECLARE i INTEGER;
    DECLARE j INTEGER;
    DECLARE lq_status VARCHAR(12);
    DECLARE end_of_cursor BOOLEAN DEFAULT 0;
    DECLARE next_candidate CURSOR FOR
      SELECT
        id,
        priority
      FROM link_queue
      WHERE status = 'Q'
      ORDER BY priority DESC, time;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SET end_of_cursor = 0;

    CALL syslog(2, 'link_next', 'START');

    SET lq_status = get_par('rl.queue');
    IF lq_status != 'STOP'
    THEN
      OPEN next_candidate;
      CALL syslog(3, 'link_next', concat('fetching ', vid, ' with priority ', vp));
      FETCH next_candidate
      INTO vid, vp;
      IF end_of_cursor = 0
      THEN
        IF vid = '*exit*'
        THEN
          DELETE FROM link_queue
          WHERE id = '*exit*';
          COMMIT;
        ELSE
          SELECT count(*)
          INTO i
          FROM links, rentities
          WHERE instance = vid
                AND rentities.id = links.rid
                AND rentities.user = '@AUTO@';
          IF i > 1
          THEN
            UPDATE link_queue
            SET status = 'L', time = CURRENT_TIMESTAMP()
            WHERE id = vid;
            COMMIT;
          ELSE
            UPDATE link_queue
            SET status = 'P', time = CURRENT_TIMESTAMP()
            WHERE id = vid;
            COMMIT;
            CALL syslog(2, 'link_next', concat('identifying ', vid, ' START'));
            CALL identify_person(vid);
            CALL syslog(2, 'link_next', concat('identifying ', vid, ' STOP'));
            UPDATE link_queue
            SET status = 'D', time = CURRENT_TIMESTAMP()
            WHERE id = vid;
            COMMIT;
          END IF;
        END IF;
      ELSE
        CALL syslog(3, 'link_next', 'Nothing in linking_queue.');
      END IF;
      CLOSE next_candidate;
      CALL syslog(2, 'link_next', 'STOP');
    ELSE
      CALL syslog(3, 'link_next', 'LINKING QUEUE STOPPED BY SYSPAR rl.queue=STOP');
    END IF;
  END ;;
DELIMITER ;
