CREATE DEFINER=`root`@`%` PROCEDURE `make_clusters`(vgraph    VARCHAR(64),
                               threshold FLOAT(7, 4))
BEGIN
    DECLARE A VARCHAR(64);
    DECLARE B VARCHAR(64);
    DECLARE TEMP FLOAT(7, 4);

    DECLARE CA INTEGER;
    DECLARE CB INTEGER;
    DECLARE BW FLOAT(7, 4);
    DECLARE BW2 FLOAT(7, 4);
    DECLARE T INTEGER;
    DECLARE NC INTEGER;
    DECLARE notfound SMALLINT DEFAULT 0;
    DECLARE a_instance VARCHAR(64);
    DECLARE leftOutCandidates CURSOR FOR
      SELECT instance
      FROM candidates
      WHERE graph = vgraph AND clust = 0;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET notfound = 1;

    CALL llog(vgraph, vgraph, vgraph, 'MAKE_CLUSTERS: START (3)');

    /* limpar analises anteriores */

    UPDATE ledges
    SET status = 'G'
    WHERE graph = vgraph AND status = 'B';
    UPDATE ledges
    SET status = 'L'
    WHERE graph = vgraph AND status = 'C';
    UPDATE candidates
    SET clust = 0
    WHERE graph = vgraph;
    -- UPDATE candidates set clust=1 WHERE instance in (select origin  from lgraphs where id=vgraph);
    UPDATE ledges
    SET bweight2 = 0
    WHERE graph = vgraph;
    COMMIT;

    SET NC := 1;
    /* precorrer o grafo e ir construindo os clusters */

    CALL reval_edges(vgraph, threshold, 0);
    /* reavaliar as ligacoes com base na situacao presente */

    mainLoop:
    LOOP

      SELECT
        e.instanceA,
        e.instanceB,
        e.bweight,
        e.bweight2,
        a.clust,
        b.clust
      INTO A, B, BW, BW2, CA, CB
      FROM
        ledges e, candidates a, candidates B
      WHERE
        a.instance = e.instanceA AND a.graph = vgraph AND
        b.instance = e.instanceB AND b.graph = vgraph AND
        e.graph = vgraph AND e.status = 'G' AND
        e.instanceA < e.instanceB AND
        edge_type(a.clust, b.clust) <> 0
      ORDER BY

        /* AQUI PODERIA ANTES ORDENAR POR BWEIGHT, BWEIGHT2 SERIA OUTRO MODO
           DE DAR PREFERENCIA 'A LIGACAO SOBRE O EFEITO.
            A DIFERENÇA EM RELACAO AO METODO
           INICIAL (CONSIDERAR AS LIGACOES POR ORDEM)
           CONSISTE EM ABANDONARMOS AS LIGACOES QUE TEM CONSEQUENCIAS
           QUE NO GLOBAL SAO INFERIORES AO LIMIAR DE ACEITABILIDADE

           PODIA TER DOIS CURSORES DEFINIDOS, UM POR CADA TIPO DE ORDENACAO
           E USAR AQUELE QUE FOSSE DEFINIDO UM PARAMETRO.

           */
        e.bweight2 DESC, e.bweight DESC, a.clust ASC, b.clust ASC
      LIMIT 1;

      IF notfound = 1
      THEN
        CALL llog(vgraph, vgraph, vgraph, 'MAKE_CLUSTERS: NO MORE EDGES');
        LEAVE mainLoop;
      END IF;

      /* AQUI DEVIA TESTAR-SE SE EXISTE MAIS DE UMA SOLUÇÃO COM O MESMO
         VALOR E EVOCAR UM MECANISMO DE DESAMBIGUAÇÃO

         ACTUALMENTE DENTRO DAS ALTERNATIVAS COM O MESMO PESO SAO
         PRIVILEGIADAS AS QUE LEVAM 'A CONSTITUICAO DE NOVOS CLUSTERS
         EDGE_TYPE = 1 E FORA DISSO E' INDETERMINADO     @
         */


      SET T := edge_type(CA, CB);

      CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: EDGE ', BW2, ' / ', BW));
      IF BW2 >= threshold
      THEN
        IF T = 1
        THEN /* novo cluster */

          CALL add_to_clust(vgraph, A, NC);
          CALL add_to_clust(vgraph, B, NC);
          CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: NEW CLUSTER ', NC));
          CALL reval_edges(vgraph, threshold, NC);
          SET NC := NC + 1;
        ELSEIF T = 2
          THEN /* instA ligada. juntar instB */

            CALL add_to_clust(vgraph, B, CA);
            CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: NODE JOIN ', B, '->', CA));
            CALL reval_edges(vgraph, threshold, CA);
        ELSEIF T = 3
          THEN /* instB ligada. juntar instA */

            CALL add_to_clust(vgraph, A, CB);
            CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: NODE JOIN ', A, '->', CB));
            CALL reval_edges(vgraph, threshold, CB);
        ELSEIF T = 4
          THEN /* dois ligados juntar clusters */

            IF CB = 1
            THEN -- this garantees that the original occurence is kept in clust 1 (where it is put at startup)
              CALL join_clust(vgraph, CB, CA);
              CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: CLUSTER JOIN ', CA, '->', CB, 'Preserving cluster 1'));
              CALL reval_edges(vgraph, threshold, CB);
            ELSE
              CALL join_clust(vgraph, CA, CB);
              CALL llog(vgraph, A, B, concat('MAKE_CLUSTERS: CLUSTER JOIN ', CB, '->', CA));
              CALL reval_edges(vgraph, threshold, CA);
            END IF;

        END IF;
      ELSE /* bad edge */

        /*
          aqui parece-me que já não se vai ter mais nenhum evento e que nao vale a pena estar a marcar as edges: estamos a precorrer as edges por ordem descrecente de BW2 de modo que de certeza que nao vamos ter reavaliação das edges nem nunca mais executar os eventos acima.

          Por outras palavras podia-se neste altura apenas fazer
          UPDATE ledges set status='B' where graph=vgraph and bw2<threshold;

        */
        CALL mark_edge(vgraph, A, B, 'B');
        CALL llog(vgraph, A, B, 'MAKE_CLUSTERS: EDGE REMOVED ');
      END IF;

      COMMIT;

    END LOOP;
    CALL llog(vgraph, A, B, 'MAKE_CLUSTERS: END OF EDGE PROCESSING ');
    /* os que sobram sao isolados */

    SET notfound = 0;
    OPEN leftOutCandidates;
    FETCH leftOutCandidates
    INTO a_instance;
    WHILE (notfound = 0) DO
      UPDATE candidates
      SET clust = NC
      WHERE graph = vgraph AND instance = a_instance;
      COMMIT;
      CALL llog(vgraph, a_instance, a_instance, concat('MAKE_CLUSTERS: NEW CLUSTER ', NC));
      SET NC = NC + 1;
      FETCH leftOutCandidates
      INTO a_instance;

    END WHILE;
    CALL remove_weak(vgraph); -- remover as fracas que foram utilizadas
    CALL llog(vgraph, vgraph, vgraph, 'MAKE_CLUSTERS: STOP');
    COMMIT;
  END ;;
DELIMITER ;
