CREATE DEFINER=`root`@`%` PROCEDURE `make_graph`(graph_id VARCHAR(64),startc VARCHAR(64),
	 							threshold FLOAT(7,4))
BEGIN
 	DECLARE cand  VARCHAR(64) DEFAULT NULL;
	DECLARE n SMALLINT;

	/* apagar grafo anterior */

	COMMIT;
	DELETE FROM ledges WHERE graph=graph_id;
	COMMIT;
	DELETE FROM candidates WHERE graph=graph_id;
	COMMIT;
	DELETE FROM linklog WHERE graph=graph_id;
	COMMIT;
	DELETE FROM lgraphs WHERE id=graph_id;
	COMMIT;
	DELETE FROM entities WHERE id=graph_id AND class='lgraph';
	COMMIT;
	
	/* inserir de novo */

	COMMIT;
	
	/* registar o ponto de partida */

	CALL llog(graph_id,startc,startc,'MAKE_GRAPH: START');

	 VALUES (graph_id,startc,'N',0,1);
	COMMIT;
	
	/* expandir */

	REPEAT
	  	SELECT min(instance) INTO cand FROM candidates WHERE status='N' AND graph=graph_id order by n;
		IF cand IS NOT NULL THEN
			CALL expand_lnode(graph_id,startc,cand,threshold);
			/*
			CALL gtest(graph_id);
			UPDATE candidates set status='T' where instance in 
				(select instanceb from ledges 
						where instanceA=startc and graph=graph_id and status='T');
			DELETE FROM ledges where graph=graph_id and status='T';
			commit;
			*/

		END IF;
	UNTIL cand IS NULL END REPEAT;
	CALL purge_graph(graph_id);
	SELECT count(*) INTO n FROM candidates WHERE graph=graph_id AND status<>'V';                         
		
	IF n = 0 THEN
		/* preencher os eventuais buracos */

		CALL fill_graph(graph_id,threshold);
	ELSE
		CALL llog(graph_id,startc,startc,'MAKE_GRAPH: SUSPENDED, SKIPPING FILL_GRAPH');
	END IF;
	CALL llog(graph_id,startc,startc,'MAKE_GRAPH: STOP');
END ;;
DELIMITER ;
