CREATE DEFINER=`root`@`%` PROCEDURE `mark_edge`(G VARCHAR(64),
                           A VARCHAR(64),
                           B VARCHAR(64),
                           S CHAR(1))
BEGIN
    UPDATE ledges
    SET status = S
    WHERE
      instanceA = A AND
      instanceB = B AND graph = G;
    UPDATE ledges
    SET status = S
    WHERE
      instanceB = A AND
      instanceA = B AND graph = G;
    CALL syslog(5, concat('mark_edge', '(', G, ')'), concat('marking edge: ', A, '->', B, ' AS ', S));
    COMMIT;
  END ;;
