CREATE DEFINER=`root`@`%` PROCEDURE `name_to_attributes`(vid VARCHAR(64), vname VARCHAR(64),vdate VARCHAR(24),lang VARCHAR(6))
BEGIN
    DECLARE remains VARCHAR(64);
    DECLARE remains2 VARCHAR(64);
    DECLARE vpname  VARCHAR(64);
    DECLARE temp INTEGER DEFAULT 0;
    DECLARE aid VARCHAR(64);

   CALL insert_log(5,'name_to_attributes',concat('entering with id=',vid,' name=', vname,' lang=',lang));

   DELETE FROM attributes WHERE entity=vid and obs='*name_to_attributes*';
   DELETE FROM entities WHERE inside=vid and groupname='*name_to_attributes*';
   COMMIT WORK;

   SELECT count(*) into temp from attributes where entity=vid;

   CALL break_name(vname,vpname ,remains);
     CALL insert_log(5,'name_to_attributes',concat('remains=', remains));
     CALL insert_log(5,'name_to_attributes',concat('vpname=', vpname));
     CALL insert_log(5,'name_to_attributes',concat('vname=', vname));

   IF vpname>' ' THEN 
     SET temp=temp+1;
     SET aid=concat(vid,'-','fname',temp);
     CALL insert_log(5,'name_to_attributes inserting',concat(aid,'=', vpname));

                VALUES (aid,vid,'*first_name',vpname,vdate,'*name_to_attributes*');
   END IF;

  WHILE remains > ' ' DO
     CALL break_name(remains,vpname,remains2);
     CALL insert_log(5,'name_to_attributes',concat('remains=', remains));
     CALL insert_log(5,'name_to_attributes',concat('vpname=', vpname));
     CALL insert_log(5,'name_to_attributes',concat('remains2=', remains2));
     
     IF NOT plig(lang, vpname) THEN
         SET temp=temp+1;
         SET aid=concat(vid,'-','oname',temp);
         CALL insert_log(5,'name_to_attributes inserting',concat(aid,'=', vpname));

                    VALUES (aid,vid,'*other_name',vpname,vdate,'*name_to_attributes*');
     END IF;
     SET remains=TRIM(remains2);
  END WHILE;
   CALL insert_log(5,'name_to_attributes','exiting');

   COMMIT;
END ;;
DELIMITER ;
