CREATE DEFINER=`root`@`%` PROCEDURE `normalize_place_names`(lang VARCHAR(12))
BEGIN

    DECLARE done INTEGER DEFAULT 0;
    DECLARE avalue VARCHAR(254);
    DECLARE aattribute VARCHAR(32);
    DECLARE navalue VARCHAR(254);
    DECLARE cinterrog INTEGER DEFAULT 0;
    DECLARE ncoef FLOAT(5, 4);

    -- TODO este cursor tem de ser parametrizado segundo a lingua
    DECLARE place_attributes CURSOR FOR SELECT
                                          attribute,
                                          value
                                        FROM value_info
                                        WHERE attribute IN ('residencia', 'naturalidade') and nvalue = value;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    CALL insert_log(3, 'normalize_place_names :', concat('STARTING WITH LANG=', lang));
    OPEN place_attributes;
    SET done := 0;
    REPEAT
      FETCH place_attributes
      INTO aattribute, avalue;
      IF done = 0
      THEN
        SET cinterrog := count_interrog(avalue);
        SET ncoef := 1 / (cinterrog + 1);
        SET navalue = normalize_place(strip_commas(avalue), lang);
        IF ncoef < 1
        THEN
          SET navalue = strip_interrog(navalue);
        END IF;
        IF navalue <> avalue
        THEN
          CALL set_nvalue(aattribute, avalue, navalue, ncoef);
          CALL insert_log(5, 'normalize_place_names :', concat(avalue, '-->', navalue));
        END IF;
      END IF;
    UNTIL done END REPEAT;

    CALL insert_log(3, 'normalize_place_names :', concat('DONE WITH LANG=', lang));
  END ;;
DELIMITER ;
