CREATE DEFINER=`root`@`%` PROCEDURE `pgraph`(G VARCHAR(64))
BEGIN
	DECLARE starttime TIMESTAMP;
	DECLARE endtime   TIMESTAMP;
	DECLARE time_new_cands  INTEGER;
	DECLARE time_eval_cands INTEGER;
	DECLARE to_be_visited INTEGER;
	DECLARE visited INTEGER;
	DECLARE nedges,ncands INTEGER;
	DECLARE bw1,bw2,bw3 FLOAT(7,3);

  	select max(time) into endtime from linklog where graph=G and text='EXPAND_LNODE: NEW CANDIDATE';
	
 	select min(time) into starttime  from linklog where graph=G and text='EXPAND_LNODE: NEW CANDIDATE';
	
 	set time_new_cands=timestampdiff(MINUTE,starttime,endtime);
	
	select min(time) into starttime from linklog where graph=G and text='EXPAND_LNODE: START';
	
	select max(time) into endtime from linklog where graph=G and text='EXPAND_LNODE: STOP';
	
	set time_eval_cands=timestampdiff(MINUTE,starttime,endtime);
	
	select count(*) into ncands from candidates where graph=G;
	
	select count(*) into to_be_visited from candidates where graph=G and status='N';
	
	select count(*) into visited from candidates where graph=G and status='V';
	
	select count(*), min(bweight),AVG(bweight) , max(bweight) into nedges,bw1,bw2,bw3 from ledges where graph=G;
	
	select G,
		time_eval_cands as Elapsed,
		date_add(now(),interval to_be_visited/(visited/time_eval_cands) minute) as Due,
		(select origin from lgraphs where id=G) as origin,
		ncands, 
		visited, 
		to_be_visited as waiting, 
		concat(format(visited/ncands*100,2),'%') as "done", 
		ncands/time_new_cands as "cands/min.", 
		visited/time_eval_cands as "visits/min.",
		nedges, 
		bw1 as min, 
		bw2 as avg, 
		bw3 as max;
	
END ;;
DELIMITER ;
