CREATE DEFINER=`root`@`%` PROCEDURE `pgraphs`()
BEGIN
select
	(select count(*)+1 from lgraphs l where l.id<lgraphs.id) as n, -- this gives a running number to the graphs
	lgraphs.id,
   (select name from persons where id=lgraphs.origin) as name,

	(select count(*) from candidates where graph=lgraphs.id) cands, 
	
	(select count(*) from candidates where graph=lgraphs.id and status='V') expanded, 	
	(select count(*) from candidates where graph=lgraphs.id and status='N') waiting,
	(select count(*) from candidates where graph=lgraphs.id and clust<>0) "clustered",
	(select count(*) from candidates where graph=lgraphs.id and clust=0) "free", 	
		(select count(distinct clust) from candidates where graph=lgraphs.id) "nclust"
from lgraphs order by id;

END ;;
