CREATE DEFINER=`root`@`%` PROCEDURE `plq`()
BEGIN
    DECLARE vid VARCHAR(64);
    DECLARE lq_status VARCHAR(12);
    DECLARE vp INTEGER;
    DECLARE i INTEGER;
    DECLARE j INTEGER;
    DECLARE end_of_cursor BOOLEAN DEFAULT 0;
    DECLARE next_candidate CURSOR FOR
      SELECT
        id,
        priority
      FROM link_queue
      WHERE status = 'Q'
      ORDER BY priority DESC, time;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SET end_of_cursor = 0;

    CALL syslog(2, 'plq', 'START');
    SET lq_status = get_par('rl.queue');
    IF lq_status != 'STOP'
    THEN

      WHILE end_of_cursor = 0 DO
        OPEN next_candidate;
        FETCH next_candidate
        INTO vid, vp;
        CALL syslog(5, 'plq', concat('fetching ', vid, ' with priority ', vp));
        IF end_of_cursor = 0
        THEN
          IF vid = '*exit*'
          THEN
            DELETE FROM link_queue
            WHERE id = '*exit*';
            COMMIT;
            SET end_of_cursor = 1;
          ELSE
            SELECT count(*)
            INTO i
            FROM links
            WHERE instance = vid;
            IF i > 1
            THEN
              UPDATE link_queue
              SET status = 'L', time = CURRENT_TIMESTAMP()
              WHERE id = vid;
              COMMIT;
            ELSE
              UPDATE link_queue
              SET status = 'P', time = CURRENT_TIMESTAMP()
              WHERE id = vid;
              COMMIT;
              CALL identify_person(vid);
              UPDATE link_queue
              SET status = 'D', time = CURRENT_TIMESTAMP()
              WHERE id = vid;
              COMMIT;
            END IF;
          END IF;
        ELSE
          SET j = 0;
          REPEAT
            SET j := j + 1;
          UNTIL j < 100000 END REPEAT;
          SET end_of_cursor = 0;
        END IF;
        CLOSE next_candidate;
      END WHILE;
      CALL syslog(2, 'plq', 'STOP');
    ELSE
      CALL syslog(2, 'plq', 'LINKING QUEUE STOPPED BY SYSPAR rl.queue=STOP');

    END IF;
  END ;;
DELIMITER ;
