CREATE DEFINER=`root`@`%` PROCEDURE `populate_family_triplets`()
BEGIN

    DELETE FROM family_triplets;
    -- PT parents
        SELECT fathers.origin AS father, mothers.origin AS mother, fathers.destination AS ego, fathers.the_date
            FROM relations fathers,
                 relations mothers
            WHERE fathers.destination = mothers.destination
              AND fathers.the_type = 'parentesco'
              and fathers.the_value = 'pai'
              AND mothers.the_type = 'parentesco'
              and mothers.the_value = 'mae';

    -- PT: sons


    SELECT fathers.destination AS father, mothers.destination AS mother, fathers.origin AS ego, fathers.the_date
    FROM relations fathers,
         relations mothers,
         persons father,
         persons mother
    WHERE fathers.origin = mothers.origin
      AND fathers.the_type = 'parentesco'
      and fathers.the_value = 'filho'
      AND mothers.the_type = 'parentesco'
      and mothers.the_value = 'filho'
      AND father.id = fathers.destination
      AND mother.id = mothers.destination
      AND father.sex = 'm'
      AND mother.sex = 'f';

    CALL insert_log(2, 'populate_family_triplets', 'Inserted sons-PT.');
-- PT: daughters

    SELECT fathers.destination AS father, mothers.destination AS mother, fathers.origin AS ego, fathers.the_date
    FROM relations fathers,
         relations mothers,
         persons father,
         persons mother
    WHERE fathers.origin = mothers.origin
      AND fathers.the_type = 'parentesco'
      and fathers.the_value = 'filha'
      AND mothers.the_type = 'parentesco'
      and mothers.the_value = 'filha'
      AND father.id = fathers.destination
      AND mother.id = mothers.destination
      AND father.sex = 'm'
      AND mother.sex = 'f';

    CALL insert_log(2, 'populate_family_triplets', 'Inserted daugthers-PT.');

    DROP TABLE IF EXISTS family_triplets_named;

    -- named triplets
    CREATE TABLE family_triplets_named
    SELECT i.father,
           fathers.name                                                                                           AS father_name,
           SUBSTRING_INDEX(fathers.name, ' ', 1)                                                                  AS father_fname,
           father_func.the_value                                                                                  AS father_function,

           i.mother,
           mothers.name                                                                                           AS mother_name,
           SUBSTRING_INDEX(mothers.name, ' ', 1)                                                                  AS mother_fname,
           mother_func.the_value                                                                                  AS mother_function,

           i.ego,
           p.name                                                                                                 AS ego_name,
           SUBSTRING_INDEX(p.name, ' ', 1)                                                                        AS ego_fname,
           ego_func.the_value                                                                                     AS ego_function,
           p.sex,

           acts.id                                                                                                AS act_id,
           acts.the_type                                                                                          AS act_type,
           i.the_date,
           concat(acts.the_type, '-', father_func.the_value, '-', mother_func.the_value, '-',
                  ego_func.the_value)                                                                             as context
    FROM family_triplets i,
         persons fathers,
         persons mothers,
         persons p,
         acts,
         relations father_func,
         relations mother_func,
         relations ego_func
    WHERE fathers.id = i.father
      AND mothers.id = i.mother
      AND i.ego = p.id
      AND (father_func.origin = fathers.id AND father_func.destination = acts.id)
      AND (mother_func.origin = mothers.id AND mother_func.destination = acts.id)
      AND (ego_func.origin = p.id AND ego_func.destination = acts.id);
    CREATE INDEX ftn_father ON family_triplets_named (father);
    CREATE INDEX ftn_mother ON family_triplets_named (mother);
    CREATE INDEX ftn_ego ON family_triplets_named (ego);
    CREATE INDEX ftn_father_name ON family_triplets_named (father_name);
    CREATE INDEX ftn_father_fname ON family_triplets_named (father_fname);
    CREATE INDEX ftn_mother_name ON family_triplets_named (mother_name);
    CREATE INDEX ftn_mother_fname ON family_triplets_named (mother_fname);
    CREATE INDEX ftn_ego_name ON family_triplets_named (ego_name);
    CREATE INDEX ftn_ego_fname ON family_triplets_named (ego_fname);
    CREATE INDEX ftn_act_id ON family_triplets_named (act_id);
    CREATE INDEX ftn_context ON family_triplets_named (context(100));

    CALL insert_log(2, 'populate_family_triplets', 'Table family_triplets_named created.');
    -- Auxiliary table for context gathering
    DROP TABLE IF EXISTS occurrences;

    CREATE TABLE occurrences
    SELECT l.instance  id,
           p.name,
           p.sex,
           l.rid,
           re.user,
           re.description,
           f.the_value the_function,
           f.the_date,
           a.id        act_id,
           a.the_type  act_type
    FROM links l,
         persons p,
         rentities re,
         relations f,
         acts a
    WHERE l.rid = re.id
      AND p.id = l.instance
      AND f.origin = p.id
      AND f.destination = a.id;

    CREATE INDEX occ_id on occurrences (id);
    CREATE INDEX occ_rid on occurrences (rid);
    CREATE INDEX occ_name on occurrences (name);
    CREATE INDEX occ_type on occurrences (act_type);
    CREATE INDEX occ_user on occurrences (user);

    CALL insert_log(2, 'populate_family_triplets', 'Table occurrences created.');


    -- Family triplets with context information

    DROP TABLE IF EXISTS family_triplets_context;

    CREATE TABLE family_triplets_context
    SELECT concat(fathers.user, '-', fathers.rid, '-', mothers.rid) as family_rid,
           fathers.rid                                              as father_rid,
           fathers.user                                                user_father,
           father,
           father_name,
           father_fname,

           mothers.rid                                              as mother_rid,
           mother,
           mother_name,
           mother_fname,

           egos.rid                                                 as ego_rid,
           ego,
           ego_name,
           ego_fname,

           ftn.act_id                                               AS act,
           ftn.act_type,
           ftn.the_date,
           ftn.context

    FROM family_triplets_named ftn
             LEFT OUTER JOIN (occurrences fathers)
                             ON (ftn.father = fathers.id)
             LEFT OUTER JOIN (occurrences mothers)
                             ON (ftn.mother = mothers.id AND mothers.user = fathers.user)
             LEFT OUTER JOIN (occurrences egos)
                             ON (ftn.ego = egos.id AND fathers.user = egos.user);

    CREATE INDEX ftn_father ON family_triplets_context (father);
    CREATE INDEX ftn_mother ON family_triplets_context (mother);
    CREATE INDEX ftn_ego ON family_triplets_context (ego);
    CREATE INDEX ftn_act ON family_triplets_context (act);
    CREATE INDEX ftn_father_name ON family_triplets_context (father_name);
    CREATE INDEX ftn_mother_name ON family_triplets_context (mother_name);
    CREATE INDEX ftn_ego_name ON family_triplets_context (ego_name);
    CREATE INDEX ftn_father_fname ON family_triplets_context (father_fname);
    CREATE INDEX ftn_mother_fname ON family_triplets_context (mother_fname);
    CREATE INDEX ftn_ego_fname ON family_triplets_context (ego_fname);
    CREATE INDEX ftn_context ON family_triplets_context (context(100));

    CALL insert_log(2, 'populate_family_triplets', 'Table family_triplets_context created.');

    /*Usando uma função de similitude de https://gist.github.com/phpenterprise/be9560412824e5b05e1c1b3f38266b57 e pesquisando pelo nome de um dos conjugues admitindo variações no outro obtêm-se resultados interessantes

    # set @homen='joaquim'
    # set @mulher='margarida'
    # select father_name, mother_name, ego_name, the_date, SIMILARITY_STRING(@mulher, mother_name) from family_triplets_context where father_name=@homem order by father_name, mother_name, the_date
    */

END ;;
