CREATE DEFINER=`root`@`%` PROCEDURE `process_names`(lang VARCHAR(6))
BEGIN
    DECLARE done INTEGER DEFAULT 0;
	 DECLARE runcount BIGINT DEFAULT 0;
    DECLARE vid VARCHAR(64);
    DECLARE vname VARCHAR(254);
    DECLARE name_type VARCHAR(64);
    DECLARE pnames CURSOR FOR SELECT id,name FROM persons;
    DECLARE anames CURSOR FOR SELECT entity,the_value FROM attributes WHERE the_type=name_type;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

    IF lang='PT' THEN
         SET name_type='nome';
    END IF;

	 CALL insert_log(4,'process_names','Cleaning previous name derived attributes - START.');
    CALL unprocess_names();
	 CALL insert_log(4,'process_names','Cleaning DONE.');
 	 CALL insert_log(4,'process_names','Processing of person names START.');
	 OPEN pnames;
	 SET runcount := 0;
    REPEAT
        FETCH pnames INTO vid,vname;
        IF NOT done THEN
            CALL name_to_attributes(vid,vname,DATE_FORMAT(now(),'%Y%m%d'),lang);
				SET runcount:= runcount+1;
				IF mod(runcount,1000) = 0 THEN
				  	 CALL insert_log(4,'process_names',concat('Person names processed: ',runcount));
				END IF;
        END IF;
    UNTIL done END REPEAT;
    CLOSE pnames;
 	 CALL insert_log(4,'process_names','Person names DONE.');

	 CALL insert_log(4,'process_names','Processing of attribute names (ls$name/...) START.');

    OPEN anames;
    SET done=0;
    REPEAT
        FETCH anames INTO vid,vname;
        IF NOT done THEN
            CALL name_to_attributes(vid,vname,DATE_FORMAT(now(),'%Y%m%d'),lang);
        END IF;
    UNTIL done END REPEAT;
    CLOSE anames;
 	 CALL insert_log(4,'process_names','Attribute names DONE.');
 	 CALL insert_log(4,'process_names','process_names DONE.');       
END ;;
DELIMITER ;
