CREATE DEFINER=`root`@`%` PROCEDURE `process_person_relation_names`(IN personid VARCHAR(64), IN lang VARCHAR(12))
BEGIN
    DECLARE vid VARCHAR(64);
    DECLARE pid VARCHAR(64);
    DECLARE vtype, inv_type, dir_type VARCHAR(64); --  type of the relation to second person
    DECLARE vvalue VARCHAR(254); --  value of relation to second person
    DECLARE vname VARCHAR(254); --  name of the second person
    DECLARE vdate VARCHAR(24);

    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE personal_in_relations CURSOR FOR
      SELECT
        p1.id,
        p1.name,
        r.the_type,
        r.the_value,
        r.the_date
      FROM normalized_relations r, persons p1
      WHERE r.destination = personid
            AND p1.id = r.origin
            AND the_type <> 'identification';
    DECLARE personal_out_relations CURSOR FOR
      SELECT
        r.destination,
        p1.name,
        r.the_type,
        r.the_value,
        r.the_date
      FROM irelations r, persons p1
      WHERE personid = r.destination
            AND p1.id = r.origin
            AND the_type <> 'identification';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;
    /*
      DECLARE CONTINUE HANDLER FOR SQLWARNING BEGIN
            END;
    */

    DELETE FROM Attributes
    WHERE entity = personid AND obs = '*relation_name_to_attributes*';
    DELETE FROM entities
    WHERE inside = personid AND groupname = '*relation_name_to_attributes*';

    COMMIT;

    OPEN personal_in_relations;

    FETCH personal_in_relations
    INTO vid, vname, vtype, vvalue, vdate;
    WHILE end_of_cursor = 0 DO

      CALL insert_log(4, 'process_person_relation_names (in) ',
                      concat('vid=', vid, ' vtype=', vtype, ' value=', vvalue, ' name=', vname));
      CALL relation_name_to_attributes(personid, vtype, vvalue, vname, vdate, lang);

      FETCH personal_in_relations
      INTO vid, vname, vtype, vvalue, vdate;
    END WHILE;
    CLOSE personal_in_relations;

    OPEN personal_out_relations;
    SET end_of_cursor = 0;
    FETCH personal_out_relations
    INTO vid, vname, vtype, vvalue, vdate;

    WHILE end_of_cursor = 0 DO

      IF vvalue <=> NULL
      THEN
        CALL insert_log(1, 'process_person_relation_names (OUT) ERROR ',
                        concat('vid=', vid, ' vtype=', vtype, ' COULD NOT INVERT RELATION TO  name=', vname));
      ELSE
        CALL insert_log(4, 'process_person_relation_names (out)',
                        concat('vid=', vid, ' vtype=', quote(vtype), ' value=', quote(vvalue), ' name=', vname));
        CALL relation_name_to_attributes(personid, vtype, vvalue, vname, vdate, lang);
      END IF;
      FETCH personal_out_relations
      INTO vid, vname, vtype, vvalue, vdate;
    END WHILE;
    CLOSE personal_out_relations;
    COMMIT WORK;
  END ;;
