CREATE DEFINER=`root`@`%` PROCEDURE `process_relation_names`(IN lang VARCHAR(12))
BEGIN
    DECLARE vid VARCHAR(64);
    DECLARE runcount BIGINT;
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE persons_with_relations CURSOR FOR
      SELECT origin
      FROM relations, persons
      WHERE origin = persons.id
      UNION DISTINCT
      SELECT destination
      FROM relations, persons
      WHERE destination = persons.id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    CALL insert_log(2, 'process_relation_names', 'START');
    CALL insert_log(3, 'process_relation_names', 'unprocessing previous runs START');
    CALL unprocess_relation_names();
    CALL insert_log(3, 'process_relation_names', 'unprocessing previous runs STOP');
    SET runcount := 0;
    OPEN persons_with_relations;
    FETCH persons_with_relations
    INTO vid;
    WHILE (end_of_cursor = 0) DO
      SET runcount = runcount + 1;
      CALL process_person_relation_names(vid, lang);
      IF mod(runcount, 1000) = 0
      THEN
        CALL insert_log(3, 'process_relation_names', concat('persons processed:', runcount));
      END IF;
      FETCH persons_with_relations
      INTO vid;
    END WHILE;
    CLOSE persons_with_relations;
    CALL insert_log(2, 'process_relation_names', 'DONE');
  END ;;
DELIMITER ;
