CREATE DEFINER=`root`@`%` PROCEDURE `relation_name_to_attributes`(
  IN vid    VARCHAR(64), --  Id of the person receiving the attributes
  IN vtype  VARCHAR(64), --  type of the relation to second person
  IN vvalue VARCHAR(254), --  value of relation to second person
  IN vname  VARCHAR(254), --  name of the second person
  IN vdate  VARCHAR(24),
  IN lang   VARCHAR(24)
)
BEGIN
    DECLARE remains VARCHAR(64);
    DECLARE remains2 VARCHAR(64);
    DECLARE vpname VARCHAR(64);
    DECLARE temp INTEGER DEFAULT 0;
    DECLARE aid VARCHAR(64);
    /*
    DECLARE CONTINUE HANDLER FOR SQLWARNING BEGIN
         END;
         */

    CALL insert_log(5, 'relation_name_to_attributes',
                    concat('entering with id=', vid, ' name=', vname, ' lang=', lang));

    SELECT count(*)
    INTO temp
    FROM attributes
    WHERE entity = vid;

    CALL break_name(vname, vpname, remains);
    IF vpname > ' '
    THEN
      CALL insert_log(5, 'relation_name_to_attributes', concat('first name=', vpname));
      SET temp = temp + 1;
      SET aid = concat(vid, '-relname-', temp);

      VALUES (aid, vid, concat('*', vvalue, '-', 'first_name'), vpname, vdate, '*relation_name_to_attributes*');
      VALUES (aid, 'attribute', vid, '*relation_name_to_attributes*');
    END IF;

    WHILE remains > ' ' DO
      CALL break_name(remains, vpname, remains2);
      CALL insert_log(5, 'relation_name_to_attributes', concat('remains=', remains));
      CALL insert_log(5, 'relation_name_to_attributes', concat('vpname=', vpname));
      CALL insert_log(5, 'relation_name_to_attributes', concat('remains2=', remains2));

      IF NOT plig(lang, vpname)
      THEN
        SET temp = temp + 1;
        SET aid = concat(vid, '-relname-', temp);
        VALUES (aid, vid, concat('*', vvalue, '-', 'other_name'), vpname, vdate, '*relation_name_to_attributes*');
        VALUES (aid, 'attribute', vid, '*relation_name_to_attributes*');
      END IF;
      SET remains = TRIM(remains2);
    END WHILE;
    CALL insert_log(5, 'relation_name_to_attributes', 'exiting');
    COMMIT;

  END ;;
DELIMITER ;
