CREATE DEFINER=`root`@`%` PROCEDURE `remove_occurrence`(vrid VARCHAR(64), occ VARCHAR(64))
BEGIN
    DECLARE nocc INTEGER;

    CALL syslog(5, 'remove_occurrence', 'START.');

    DELETE
    FROM links
    WHERE rid = vrid
      AND instance = occ;
    SELECT count(*)
    INTO nocc
    FROM links
    WHERE rid = vrid;
    IF (nocc = 0)
    THEN
        CALL remove_rentity(vrid);
        COMMIT;
    END IF;
    CALL syslog(5, 'remove_occurrence', 'STOP.');

END ;;
