CREATE DEFINER=`root`@`%` PROCEDURE `remove_weak`(G VARCHAR(64))
BEGIN
    DECLARE e_instanceA, e_instanceB VARCHAR(64);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE weakEdges CURSOR FOR
      SELECT
        instanceA,
        instanceB
      FROM ledges e, candidates a, candidates b
      WHERE a.instance = instanceA AND b.instance = instanceB AND
            a.graph = G AND b.graph = G AND
            e.graph = G AND a.clust <> b.clust AND e.status = 'L';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    OPEN weakEdges;
    FETCH weakEdges
    INTO e_instanceA, e_instanceB;
    WHILE (end_of_cursor = 0) DO
      CALL mark_edge(G, e_instanceA, e_instanceB, 'C');
      FETCH weakEdges
      INTO e_instanceA, e_instanceB;
    END WHILE;
  END ;;
DELIMITER ;
