CREATE DEFINER=`root`@`%` PROCEDURE `reval_edges`(vgraph    VARCHAR(64),
                             threshold FLOAT(7, 4),
                             lastClust INTEGER)
main:
  BEGIN
    DECLARE vedge_type SMALLINT;
    DECLARE vbweight2 FLOAT(7, 4);
    DECLARE vmax FLOAT(7, 4);
    DECLARE edge_count INTEGER;
    DECLARE oldClustA SMALLINT;
    DECLARE oldClustB SMALLINT;
    DECLARE oldTest FLOAT(7, 4);
    DECLARE graphFactor FLOAT(2, 1);
    DECLARE e_instanceA, e_instanceB VARCHAR(64);
    DECLARE e_bweight FLOAT(7, 4);
    DECLARE e_clustA, e_clustB SMALLINT;
    DECLARE e_status CHAR(1);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE allTheEdges CURSOR FOR
      SELECT
        e.bweight,
        a.clust,
        b.clust,
        e.instanceA,
        e.instanceB,
        e.status
      FROM
        ledges e, candidates a, candidates b
      WHERE
        a.instance = e.instanceA
        AND a.graph = vgraph
        AND b.instance = e.instanceB
        AND b.graph = vgraph
        AND e.graph = vgraph
        AND e.status = 'G' --  G= good edge above threshold
        AND e.instanceA < e.instanceB --  this prevents checking the same edge twice
        -- supposing that the last changed cluster is available we just touch the relevant edges
        AND (a.clust = lastClust OR b.clust = lastClust) AND a.clust <> b.clust
      --	AND edge_type(a.clust,b.clust) <> 0 -- why should it be zero
      ORDER BY
        e.bweight DESC, a.clust, b.clust;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    -- UPDATE ledges SET bweight2 = 0 WHERE graph=vgraph;
    -- COMMIT;

    CALL llog(vgraph, vgraph, vgraph, 'REVAL_EDGES: START');

    IF lastClust = 0
    THEN -- special case of first evaluation we just copy the bweigh
      UPDATE ledges
      SET bweight2 = bweight
      WHERE graph = vgraph AND instanceA < instanceB;
      COMMIT;
      CALL llog(vgraph, vgraph, vgraph, 'REVAL_EDGES: STOP (INITIAL RUN)');
      LEAVE main;
    END IF;
    SET vmax := 0;
    SET oldClustA := 0;
    SET oldClustB := 0;
    SET oldTest := 0;
    SET edge_count := 0;
    SET graphFactor = CAST(get_par('rl.graph.factor') AS DECIMAL);

    /* go through the edges and evaluate */

    OPEN allTheEdges;
    FETCH allTheEdges
    INTO e_bweight, e_clustA, e_clustB, e_instanceA, e_instanceB, e_status;

    mainloop:
    WHILE (end_of_cursor = 0) DO
      SET edge_count := edge_count + 1;
      CALL llog(vgraph, e_instanceA, e_instanceB, concat('REVAL_EDGES: BWEIGHT=', e_bweight));
      IF e_bweight < vmax
      THEN -- this was base on the misconceptiong that bweight2 would increase to a maximum and then drop.
        -- so when we detect the drop there would be no point in continuing
        -- but this has proved to be false: it can increase, then decrease
        -- then grow to a higher value than that of the beggining
        CALL llog(vgraph, e_instanceA, e_instanceB, 'REVAL_EDGES: e_bweight < vmax');
      -- LEAVE mainLoop;
      END IF;
      SET vbweight2 := 0;
      /* este vai receber o bweight ponderado */


      -- we now check what kind of action this edge would trigger
      SET vedge_type := edge_type(e_clustA, e_clustB);

      IF vedge_type = 1
      THEN /* New cluster */

        SET vbweight2 := e_bweight; /* the value is the same as the edge value */

      ELSEIF vedge_type = 2
        THEN /* instA connected. join instB */

          SET vbweight2 := can_enter_clust(vgraph, e_instanceB, e_clustA);
      ELSEIF vedge_type = 3
        THEN /* instB connected. join instA */

          SET vbweight2 := can_enter_clust(vgraph, e_instanceA, e_clustB);
      ELSEIF vedge_type = 4
        THEN /* both connected, we are joining */

          IF e_clustA = oldClustA AND e_clustB = oldClustB
          THEN
            SET vbweight2 := oldTest; -- this is to save computing can_join_clust a lot of times
          -- CALL llog(vgraph,e_clustA,e_clustB,'CAN_JOIN_CLUSTERS SKIPPED');
          ELSE
            SET vbweight2 := can_join_clust(vgraph, e_clustA, e_clustB);
            SET oldTest := vbweight2;
            SET oldClustA := e_clustA;
            SET oldClustB := e_clustB;
          END IF;
      ELSEIF vedge_type <> 0
        THEN

          CALL llog(vgraph, e_instanceA, e_instanceB, 'REVAL_EDGES: ILLEGAL EDGE TYPE');
      END IF;

      SET vbweight2 := (vbweight2 + e_bweight * graphFactor) / (graphFactor + 1); -- valorizamos a ligacao sobre a media

      SET vmax := greatest(vmax, vbweight2);

      COMMIT;
      UPDATE ledges
      SET bweight2 = vbweight2
      WHERE graph = vgraph AND instanceA = e_instanceA AND
            instanceB = e_instanceB; -- here we could store the edge type
      COMMIT;
      FETCH allTheEdges
      INTO e_bweight, e_clustA, e_clustB, e_instanceA, e_instanceB, e_status;
    END WHILE;
    CALL llog(vgraph, vgraph, vgraph, concat('REVAL_EDGES: STOP AFTER EVALUATING ', edge_count, ' EDGES'));
    COMMIT;
  END ;;
DELIMITER ;
