CREATE DEFINER=`root`@`%` PROCEDURE `rm_graph`(graph_id VARCHAR(64))
BEGIN
	COMMIT;
	DELETE FROM ledges WHERE graph=graph_id;
	DELETE FROM candidates WHERE graph=graph_id;
	DELETE FROM linklog WHERE graph=graph_id;
	DELETE FROM lgraphs WHERE id=graph_id;
	DELETE FROM entities WHERE id=graph_id;
	COMMIT;

END ;;
