CREATE DEFINER=`root`@`%` PROCEDURE `rm_graphn`(n INTEGER)
BEGIN
	DECLARE g VARCHAR(64);
	DECLARE gi VARCHAR(64);
	DECLARE end_of_loop BOOLEAN;
	DECLARE graphs CURSOR FOR SELECT id from lgraphs ORDER BY id;
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_loop = 1;
	
	OPEN graphs;
	set end_of_loop=0;
	FETCH graphs INTO g;
	WHILE(end_of_loop=0) DO 
		SET n = n-1;
		IF n= 0 THEN
			SET gi=g;
		END IF;
	FETCH graphs INTO g;
	END WHILE; 
	close graphs;
   CALL rm_graph(gi);
END ;;
