CREATE DEFINER=`root`@`%` PROCEDURE `update_attributes_info`()
BEGIN
    DECLARE the_date DATETIME;
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE one_attribute VARCHAR(32);
    DECLARE attribute_cursor CURSOR FOR SELECT DISTINCT the_type
                                        FROM attributes;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    SELECT now()
    INTO the_date;

    OPEN attribute_cursor;
    FETCH attribute_cursor
    INTO one_attribute;
    WHILE (end_of_cursor = 0) DO
      CALL insert_log(3, 'update_attributes_info', one_attribute);
      CALL update_attribute_info(one_attribute, the_date);
      -- commit;
      FETCH attribute_cursor
      INTO one_attribute;
    END WHILE;
  END ;;
