CREATE DEFINER=`root`@`%` PROCEDURE `update_attribute_info`(the_attribute VARCHAR(32),
                                       the_date      DATETIME)
BEGIN

    DECLARE the_totpersons INTEGER(7) DEFAULT 0;
    DECLARE the_npersons INTEGER(7) DEFAULT 0;
    DECLARE the_spectre INTEGER(6) DEFAULT 0;
    --	DECLARE the_descrim  FLOAT(8,6) DEFAULT 0;
    --	DECLARE the_descrimT FLOAT(8,6) DEFAULT 0;
    DECLARE the_pnotlink FLOAT(7, 6) DEFAULT 0;
    DECLARE the_pnlcases INTEGER(6) DEFAULT 0;
    DECLARE the_Nspectre INTEGER(6) DEFAULT 0;
    DECLARE the_Ndescrim FLOAT(8, 6) DEFAULT 0;
    DECLARE the_NdescrimT FLOAT(8, 6) DEFAULT 0;
    DECLARE the_Npnotlink FLOAT(7, 6) DEFAULT 0;
    DECLARE the_Npnlcases FLOAT(6, 0) DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR SQLWARNING BEGIN
      VALUES (now(), 1, 'FUNCTION update_attribute_info', concat('Problem with ', the_attribute));
    END;

    CALL insert_log(4, 'update_attribute_info', concat('START: ', the_attribute));
    SET the_npersons = attribute_npersons(the_attribute);
    CALL insert_log(5, 'update_attribute_info', concat('the_npersons: ', cast(the_npersons AS CHAR)));
    SET the_spectre = attribute_spectre(the_attribute);
    CALL insert_log(5, 'update_attribute_info', concat('the_spectre: ', cast(the_spectre AS CHAR)));
    SET the_nspectre = attribute_nspectre(the_attribute);
    CALL insert_log(5, 'update_attribute_info', concat('the_nspectre: ', cast(the_nspectre AS CHAR)));
    SET the_Ndescrim = attribute_ndescrim(the_attribute, the_npersons);
    CALL insert_log(5, 'update_attribute_info', concat('the_ndescrim: ', cast(the_ndescrim AS CHAR)));
    SET the_NdescrimT = attribute_ndescrimT(the_attribute, the_npersons, the_totpersons);
    CALL insert_log(5, 'update_attribute_info', concat('the_NdescrimT: ', cast(the_NdescrimT AS CHAR)));
    CALL attribute_npnotlink(the_attribute, the_npnlcases, the_npnotlink);
    CALL insert_log(5, 'update_attribute_info', concat('the_npnotlink:', cast(the_npnotlink AS CHAR)));

    CALL set_attribute_info(the_attribute,
                            the_npersons,
                            the_spectre,
                            --	 	the_descrim,
                            --	 	the_descrimT,
                            the_pnotlink,
                            the_pnlcases,
                            the_Nspectre,
                            the_Ndescrim,
                            the_NdescrimT,
                            the_Npnotlink,
                            the_Npnlcases,
                            the_date);
    CALL insert_log(4, 'update_attribute_info', 'STOP');
  END ;;
