CREATE DEFINER=`root`@`%` PROCEDURE `update_attribute_nvalues_info`(the_attribute VARCHAR(32))
BEGIN
    DECLARE the_date DATE;
    DECLARE the_anpersons INTEGER(6);
    DECLARE a_nvalue VARCHAR(254);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE a_cursor CURSOR FOR SELECT distinct nvalue
                                FROM value_info
                                WHERE the_attribute = attribute;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    CALL insert_log(4, 'update_attribute_nvalues_info', concat('START ', the_attribute));
    SET the_anpersons = get_attribute_npersons(the_attribute);
    CALL insert_log(5, 'update_attribute_nvalues_info', concat('npersons=', the_anpersons));

    OPEN a_cursor;
    FETCH a_cursor
    into a_nvalue;
    WHILE (end_of_cursor = 0) DO
      IF end_of_cursor = 0
      THEN
        CALL insert_log(5, 'update_attribute_nvalues_info', concat('START ', the_attribute, '/', a_nvalue));
        CALL update_nvalue_info(the_attribute, a_nvalue, SYSDATE());
        CALL insert_log(5, 'update_attribute_nvalues_info', concat('STOP  ', the_attribute, '/', a_nvalue));
      END IF;
      FETCH a_cursor
      into a_nvalue;
    END WHILE;
    COMMIT;
    CALL insert_log(4, 'update_attribute_nvalues_info', 'STOP');
  END ;;
