CREATE DEFINER=`root`@`%` PROCEDURE `update_attribute_nvalues_link_info`(the_attribute VARCHAR(32))
BEGIN
    DECLARE the_date DATE;
    DECLARE a_nvalue VARCHAR(254);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE a_cursor CURSOR FOR SELECT distinct nvalue
                                FROM value_info
                                WHERE the_attribute = attribute;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    OPEN a_cursor;
    FETCH a_cursor
    into a_nvalue;
    WHILE (end_of_cursor = 0) DO
      IF end_of_cursor = 0
      THEN CALL update_nvalue_link_info(the_attribute, a_nvalue, NOW());
      END IF;
      FETCH a_cursor
      into a_nvalue;
    END WHILE;
    COMMIT;
    -- now we have to get rid of the entries that are out of date.
    delete from nvalue_info
    where attribute = the_attribute and nvalue not in (select nvalue
                                                       from value_info
                                                       where attribute = the_attribute);
    commit;

  END ;;
