CREATE DEFINER=`root`@`%` PROCEDURE `update_cache`()
BEGIN

    CALL insert_log(2, 'update_cache', 'cache update started');
    /* Tables used in explore.vm */
    DROP TABLE IF EXISTS atr_stats;
    CREATE TABLE atr_stats AS
    select the_type, count(*) as n
    from attributes
    where the_type not like '#%'
      and the_type not like '*%'
    group by the_type
    order by the_type;

    DROP TABLE IF EXISTS func_stats;
    CREATE TABLE func_stats AS
    SELECT the_value AS func,
           count(*)  AS n
    FROM relations
    WHERE the_type = 'function-in-act'
    GROUP BY the_value
    ORDER BY the_value;

    DROP TABLE IF EXISTS rel_stats;
    CREATE TABLE rel_stats AS
    select the_type, count(*) as n from relations group by the_type order by the_type;

    DROP TABLE IF EXISTS place_stats;
    CREATE TABLE place_stats AS
    SELECT id as rid, description as name, user
    FROM rentities
    where the_class = 'rgeoentity'
      and user = @ADMIN
    order by description;

    /* call the update of relational information (inverted relations) */
    CALL check_rel_equivalences();
    /* update family from record linking info */
    CALL populate_family_triplets();

    CALL insert_log(2, 'update_cache', 'cache update finished');
END ;;
