CREATE DEFINER=`root`@`%` PROCEDURE `update_nvalue_info`(the_attribute VARCHAR(32),
                                    the_nvalue    VARCHAR(254),
                                    the_date      DATE)
BEGIN
    DECLARE the_npersons INTEGER(6);
    DECLARE the_anpersons INTEGER(6);
    DECLARE the_prandom FLOAT(7, 6);
    DECLARE the_rfreq FLOAT(7, 6);
    DECLARE t1 TIMESTAMP;
    DECLARE e FLOAT(10, 4);

    -- we count how many distinct persons have this nvalue in the data

    CALL insert_log(5, 'update_attribute_nvalue_info', concat('START>>> ', the_attribute, '/', the_nvalue));
    select sysdate()
    into t1;
    SELECT count(distinct entity)
    INTO the_npersons
    FROM attributes a, value_info v
    WHERE v.nvalue = the_nvalue AND v.attribute = the_attribute AND
          a.the_type = the_attribute AND a.the_value = v.value;
    select sysdate() - t1
    into e;

    CALL insert_log(5, 'update_attribute_nvalue_info', concat('npersons(value)=', the_npersons, ' time=', e));

    -- we get the number of persons with this attribute
    SET the_anpersons = get_attribute_npersons(the_attribute);
    CALL insert_log(5, 'update_attribute_nvalue_info', concat('npersons(attribute)=', the_anpersons));

    -- calculate the relative frequency.
    IF the_anpersons > 0
    THEN
      SET the_rfreq = the_npersons / the_anpersons;
    ELSE
      SET the_rfreq = NULL;
    END IF;
    -- we calculate the probability of random match as the square of the rfrequency
    IF the_npersons = 1
    THEN
      SET the_prandom = 0;
    ELSE
      SET the_prandom = the_rfreq * the_rfreq;
    END IF;

    CALL set_nvalue_info(the_attribute, the_nvalue, the_npersons, the_rfreq, the_prandom, the_date);
    COMMIT WORK;
    CALL insert_log(5, 'update_attribute_nvalue_info', concat('STOP<<< ', the_attribute, '/', the_nvalue));

  END ;;
DELIMITER ;
