CREATE DEFINER=`root`@`%` PROCEDURE `update_values_info`()
BEGIN
    DECLARE one_attribute VARCHAR(32);
    DECLARE end_of_cursor SMALLINT DEFAULT 0;
    DECLARE attribute_cursor CURSOR FOR SELECT DISTINCT the_type
                                        FROM attributes;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET end_of_cursor = 1;

    OPEN attribute_cursor;
    REPEAT
      FETCH attribute_cursor
      INTO one_attribute;
      IF end_of_cursor = 0
      THEN
        CALL update_attributes_value_info(one_attribute);
        COMMIT;
      END IF;
    UNTIL end_of_cursor = 1 END REPEAT;
    DELETE FROM value_info
    WHERE attribute NOT IN (SELECT DISTINCT the_type
                            FROM attributes);
    COMMIT;

  END ;;
DELIMITER ;
