CREATE DEFINER=`root`@`%` PROCEDURE `update_value_info`(
    IN the_attribute VARCHAR(32), IN svalue VARCHAR(254), IN the_date DATETIME
  )
BEGIN
    DECLARE the_npersons INTEGER(6);
    DECLARE the_rfreq FLOAT(7, 6);
    DECLARE the_nvalue VARCHAR(254);
    DECLARE the_normcoef FLOAT(5, 4);
    DECLARE the_anpersons INTEGER(6);

    CALL insert_log(4, 'update_attributes_value_info', concat(the_attribute, '/', svalue));
    SELECT COUNT(DISTINCT entity)
    INTO the_npersons
    FROM attributes
    WHERE the_type = the_attribute AND the_value = svalue;
    SELECT
      nvalue,
      normcoef
    INTO the_nvalue, the_normcoef
    FROM value_info
    WHERE attribute = the_attribute AND VALUE = svalue;
    SET the_anpersons = get_attribute_npersons(the_attribute);
    IF the_anpersons > 0
    THEN
      SET the_rfreq = the_npersons / the_anpersons;
    ELSE
      SET the_rfreq = NULL;
    END IF;
    IF the_nvalue IS NULL
    THEN
      SET the_nvalue = svalue;
      SET the_normcoef = 1.0;
    END IF;
    CALL set_value_info(the_attribute, svalue, the_nvalue, the_normcoef,
                        the_npersons, the_rfreq, the_date);
    COMMIT WORK;
  END ;;
DELIMITER ;
