CREATE DEFINER=`root`@`%` PROCEDURE `value_normalization_suggestions`(vattribute VARCHAR(32), vvalue VARCHAR(254), threshold INTEGER)
BEGIN
    select
      n1.id,
      n1.attribute,
      n1.nvalue,
      n1.npersons
    from nvalue_info n1
    where n1.attribute = vattribute and
          n1.npersons > threshold and
          n1.nvalue sounds like vvalue
    order by n1.attribute, n1.npersons desc;
  END ;;
DELIMITER ;
